(22, 1, '2014-11-05 14:52:40', '2014-11-05 14:52:40', '<h3 class=\"upp\">Quy định đối với người mua</h3>\r\n<div class=\"desc_h2\">\r\n\r\nLà người mua, bạn có trách nhiệm đọc kỹ, hiểu và tuân thủ đúng những chính sách, quy định, điều khoản dành cho người mua. <strong>redep24.com</strong> có thể thay đổi những quy định này bất cứ lúc nào cần thiết. Những quy định mới sẽ có hiệu lực ngay khi được đăng tải lên <strong>redep24.com</strong>.\r\n\r\n<strong>redep24.com</strong> đưa ra những quy định này nhằm:\r\n\r\n-  Tạo dựng một môi trường mua bán an toàn, thuận lợi và thân thiện với mọi người dùng.\r\n\r\n- Giảm thiểu những rủi ro cho cả người bán và người mua.\r\n\r\n- Cung cấp cơ hội công bằng cho tất cả người mua.\r\n\r\n- Cung cấp kinh nghiệm mua hàng trực tuyến thú vị.\r\n\r\n<span style=\"text-decoration: underline;\"><strong>Quy định mua hàng</strong></span>\r\n\r\nTrước khi quyết định mua hàng, người mua cần hiểu rõ và tuân thủ những điều sau:\r\n\r\nHiểu và đồng ý  với những quy định về mua bán, giao dịch trên <strong>redep24.com</strong>.\r\n\r\nChỉ mua hàng khi chấp nhận và hiểu rõ những quy định trong tin đăng của người bán, không cố tình hiểu sai nhằm phá rối việc mua bán của người khác.Tìm hiểu kỹ các thông tin về sản phẩm, dịch vụ, người bán; tham khảo những thông tin từ người mua trước để có lựa chọn chính xác.Cung cấp đầy đủ và chính xác các thông tin cá nhân để phục vụ cho việc thanh toán và giao nhận hàng hóa.Không sử dụng hình thức thanh toán khi giao hàng để quấy rối, phá hoại việc kinh doanh của người khác.Thường xuyên theo dõi tình trạng đơn hàng của mình trên <strong>redep24.com</strong> hoặc tình trạng vận chuyển của lô hàng trên website  để có những xử lý kịp thời.\r\n\r\nTìm hiểu cách thức gửi khiếu nại và quy trình giải quyết khiếu nại của <strong>redep24.com</strong> cho những trường hợp có tranh chấp để được bảo vệ. Chủ động giữ liên lạc với người bán để giải đáp những thắc mắc về sản phẩm và việc giao nhận hàng. Liên lạc và gửi khiếu nại cho <strong>redep24.com</strong> trong những trường hợp người bán bất hợp tác hoặc có những phát sinh hai bên không đạt được thoả thuận.\r\n\r\nTrân trọng!\r\n\r\n</div>', 'Quy định mua hàng', '', 'publish', 'open', 'open', '', 'quy-dinh-mua-hang', '', '', '2015-12-28 11:28:01', '2015-12-28 04:28:01', '', 0, 'http://localhost/webseo24h/?page_id=22', 0, 'page', '', 0),
