(701, 1, '2015-01-21 08:25:29', '2015-01-21 01:25:29', '<div class=\"chitiet-sp-left\"></div>\r\n<div class=\"chitiet-sp-right\">\r\n<table class=\"table-chitiet-sp\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td class=\"tb-ct-tensp\" colspan=\"2\">\r\n\r\n[caption id=\"attachment_703\" align=\"aligncenter\" width=\"500\"]<a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/01/Robusta-cafe-hat-1.png\"><img class=\"wp-image-703 size-full\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/01/Robusta-cafe-hat-1.png\" alt=\"cafe-hat-robusta-loai-1\" width=\"500\" height=\"333\" /></a> Cà phê hạt Robusta 100% nguyên chất[/caption]</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"2\">Được tuyển chọn từ những trái cà phê Robusta chín đỏ tại vùng lãnh thổ cà phê hàng đầu Việt Nam, vùng lãnh thổ cà phê Buôn Mê Thuột, mang đậm giá trị di sản cà phê Việt Nam\r\nPhong vị đắng dịu và mùi thơm nồng nàn là đặc trưng của cà phê Robusta. Với 100% hạt cà phê Robusta nguyên chất được tuyển chọn kỹ lưỡng, công nghệ rang hiện đại, cộng với sự nổ lực không ngừng của chúng tôi để hương vị tinh tuý thiên nhiên được giữ nguyên vẹn trong từng giọt cà phê nguyên chất</td>\r\n</tr>\r\n<tr>\r\n<td class=\"tb-ct-lef\">Thành Phần</td>\r\n<td>100 % hạt Robusta</td>\r\n</tr>\r\n<tr>\r\n<td class=\"tb-ct-lef\">Bảo Quản Hạn Dùng</td>\r\n<td>- Bảo quản nơi thoáng mát, tránh ánh nắng trực tiếp\r\n<div>- Hạn dùng được in trên bao bì hoặc 18 tháng kể từ ngày sản xuất.</div></td>\r\n</tr>\r\n<tr>\r\n<td class=\"tb-ct-lef\">Quy Cách Đóng Gói</td>\r\n<td>20 kg/bao hoặc 500 gr/túi</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n\r\n[caption id=\"attachment_704\" align=\"aligncenter\" width=\"400\"]<a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/01/robusta-cafe-hat-02.jpg\"><img class=\"wp-image-704 size-full\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/01/robusta-cafe-hat-02.jpg\" alt=\"Cà phê hạt Robusta nguyên chất Face Coffee\" width=\"400\" height=\"400\" /></a> Cà phê hạt Robusta nguyên chất Face Coffee[/caption]\r\n\r\nRobus trong Tiếng Anh có nghĩa là mạnh. Cây cà phê Robusta ưa sống ở vùng nhiệt đới, độ cao thích hợp để trồng cây là dưới 1000 m. Nhiệt độ ưa thích của cây khoảng 24-29°C, lượng mưa khoảng trên 1000 mm. Cây cà phê vốn cần nhiều ánh sáng mặt trời hơn so với cây cà phê chè. Cà phê  Robusta có vị đậm đà. Hàm lượng cafeinne cao (từ 2,4-4,4 %).\r\n\r\n&nbsp;\r\n\r\nViệt Nam tự hào là quốc gia xuất khẩu cà phê đứng hàng thứ 2 trên thế giới sau Brazin.  Hiện nay gần 90% diện tích cà phê ở Việt Nam được trồng là cà phê Robusta.  Sản lượng xuất khẩu hàng năm của VN khoảng 1  triệu tấn và hầu hết là  cà phê Robusta. Tuy nhiên, vì trên thế giới Robusta được xem là cà phê bình dân, hương vị không được ưa chuộng và Robusta luôn luôn  có giá trị thương phẩm thấp hơn nhiều so với Arabica. Cà phê Robusta Việt nam (cùng với sự yếu kém trong kỹ thuật canh tác, bảo quản và chế biến...) không dược thế giới đánh giá cao về chất lượng. Ở Việt nam, cà phê  bột có thành phần Robusta có mặt khắp nơi, nên hầu hết người Việt Nam biết đến cà phê là biết Robusta. Vị đậm đà nhưng Robusta không có mùi thơm quyến rũ như dòng Arabica. Hơn nữa, do các nhà sản xuất cà phê bột ở Việt nam muốn hạ giá thành đã trộn vào Robusta một tỷ lệ lớn các hạt đậu bắp rang, rồi tẩm ướp vào hổn hợp nầy đủ các loại hương liệu nhân tạo với nồng độ rất cao. Qua đó, rất nhiều sản phẩm   cà phê việt có phong vị thật đậm, rất đắng, đen thùi, sóng sánh và thơm nồng nực mùi hương liệu mà giá lại thật rẽ, được bán ở khắp mọi nơi. Hầu như mùi hương mà người tiêu dùng Việt nam cảm thụ được ở các quán cà phê lớn, nhỏ  là mùi hương bốc ra của đủ loại hóa chất chứ không phải là mùi hương thật sự của hạt cafe (hương của tinh cà phê, hương bơ, hương sữa, hương va ni, hương sô cô la, hương hạt dẽ, hương béo... đủ thứ hương liệu ...).\r\n\r\nRobusta là mạnh mẽ, Robusta đại diện cho phái nam, là cực dương, Robusta thu hút đến mê người, Robusta là bạn đồng hành, đem đến cho ta sự sáng suốt trong suy nghĩ, nghị lực trong công việc, sức mạnh để quyết định, sự sảng khoái, niềm vui  và tình thân ái khi ngồi bên bạn bè. Ôi Robusta, người bạn đường thân thiết! Robusta niềm đam mê của ta!\r\n\r\n[caption id=\"attachment_702\" align=\"aligncenter\" width=\"500\"]<a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/01/robusta-cafe-hat-01.png\"><img class=\"wp-image-702 size-full\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/01/robusta-cafe-hat-01.png\" alt=\"Cà phê hạt Robusta nguyên chất Face Coffee\" width=\"500\" height=\"334\" /></a> Cà phê hạt Robusta nguyên chất Face Coffee[/caption]', 'Cafe hạt Robusta cực mạnh', '', 'publish', 'open', 'open', '', 'cafe-hat-robusta-cuc-manh', '', '', '2015-11-10 09:39:24', '2015-11-10 02:39:24', '', 0, 'http://redep24.lavadep.com/?p=701', 0, 'post', '', 0),
