(680, 2, '2015-01-16 12:08:59', '2015-01-16 05:08:59', '<div><b><span style=\"font-size: large;\">*** Netbook Samsung N210:</span></b></div>\r\n<div><b><span style=\"font-size: large;\"> </span></b></div>\r\n<div>\r\n<div><b><span style=\"font-size: large;\">CPU: Intel Atom N450 1.66Ghz</span></b><b><span style=\"font-size: large;\">.</span></b></div>\r\n<div><b><span style=\"font-size: large;\">RAM: 2GB DDR2.</span></b></div>\r\n<div><b><span style=\"font-size: large;\">HDD: 250GB SATA còn nguyên Recovery.</span></b></div>\r\n<div><b><span style=\"font-size: large;\">Display: 10.1\" 16:9.</span></b></div>\r\n<div><b><span style=\"font-size: large;\">Battery: 1h.</span></b></div>\r\n<div><b><span style=\"color: #0000ff; font-size: large;\">Máy đẹp 95%, chạy ổn định mượt mà.</span></b></div>\r\n<div><b><span style=\"color: #0000ff; font-size: large;\">Giá bán thanh lý: 2.500.000</span></b></div>\r\n<div>\r\n\r\n[caption id=\"attachment_687\" align=\"aligncenter\" width=\"300\"]<a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/01/laptop-SamSung.jpg\"><img class=\"wp-image-687 size-medium\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/01/laptop-SamSung-470x470.jpg\" alt=\"laptop-SamSung\" width=\"300\" height=\"300\" /></a> laptop-SamSung-N210[/caption]\r\n\r\n<a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/01/laptop-SamSung-n210-2.jpg\"><img class=\"aligncenter wp-image-688 size-medium\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/01/laptop-SamSung-n210-2-470x470.jpg\" alt=\"laptop-SamSung-n210-2\" width=\"300\" height=\"300\" /></a></div>\r\n<div></div>\r\n<div>\r\n<div>\r\n\r\n<b><span style=\"font-size: medium;\">*** 2 em iMac G5 cho các bác tập chơi MAC OS, đọc báo nghe nhạc online, soạn thảo office ngon lành, đặt tại shop bán hàng ngay quầy tiếp tân cho khách xem mẫu hàng cũng ok lắm, cấu hình như sau:</span></b>\r\n\r\n<span style=\"font-size: medium;\"><strong>-</strong