(836, 4, '2015-03-10 23:33:49', '2015-03-10 16:33:49', '- xuất xứ từ những vườn café sạch với chất lượng xuất khẩu tại Đắclăk, Đắc Nông, Lâm Đồng, Đà lạt. Sàn hạt từ Φ18 trở lên to đều đẹp.\r\n\r\n- Hương vị: Vị đắng, hương thơm dịu, nước có màu nâu sánh ít, không chua, hàm lượng cafein vừa đủ.\r\n\r\n- Đối tượng : Các quán kinh doanh cafe nguyên chất, cà phê sạch.\r\n\r\n[caption id=\"attachment_704\" align=\"aligncenter\" width=\"400\"]<a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/01/robusta-cafe-hat-02.jpg\"><img class=\"wp-image-704 size-full\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/01/robusta-cafe-hat-02.jpg\" alt=\"Cà phê hạt Robusta nguyên chất Face Coffee\" width=\"400\" height=\"400\" /></a> Cà phê hạt Robusta nguyên chất Face Coffee[/caption]\r\n\r\n- cách pha:\r\n\r\n- Nước pha càng tinh khiết, sản phẩm của bạn càng ngon. Tốt nhất, nên dùng nước sôi 100 độ C.\r\n- Lượng cà phê cần dùng tùy thuộc vào sở thích của mỗi người. Tuy nhiên, lượng trung bình khoảng 29 gam cho loại đen và 17 gam đối với loại có sữa.\r\nCác bước cơ bản:\r\n- Đảm bảo phin và tách phải sạch và khô.\r\n- Đặt phin lên miệng tách, cho vào phin một lượng cà phê, sau đó lắc nhẹ phin đều tay, xoay theo hình xoắn ốc cho có độ chặt nhất định.\r\n- Cho khoảng 20 ml nước sôi vào phin, đợi đến khi bột cà phê đã hấp thu hết nước, tiếp tục cho thêm 45 ml nước hoặc nhiều hơn vào. Thao tác này giúp bạn giảm thời gian pha chế.\r\n- Đậy nắp trên miệng phin, đợi từng giọt nhỏ xuống tách.\r\n\r\n- cho lượng đường sữa tùy sở thích, dùng muỗng đánh đều cho đường sữa hòa tan hết.\r\nMỗi tách cà phê truyền thống sẽ cho khoảng 65 giọt trong thời gian 1 phút.\r\n\r\n[caption id=\"attachment_703\" align=\"aligncenter\" width=\"300\"]<a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/01/Robusta-cafe-hat-1.png\"><img class=\"wp-image-703 size-medium\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/01/Robusta-cafe-hat-1-470x333.png\" alt=\"cafe-hat-robusta-loai-1\" width=\"300\" height=\"212\" /></a> Cà phê hạt Robusta 100% nguyên chất[/caption]', 'Café hạt Robusta Sảng Khoái 01', '', 'publish', 'open', 'open', '', 'cafe-hat-robusta-sang-khoai-01', '', '', '2015-11-10 09:27:34', '2015-11-10 02:27:34', '', 0, 'http://redep24.lavadep.com/?p=836', 0, 'post', '', 1),
