(577, 3, '2014-12-28 11:39:39', '2014-12-28 04:39:39', 'Tên thường gọi:  Cây Trầu bà xanh, cây <b>Hoàng Tâm Diệp</b>\r\n\r\nTên khoa học: <i>Philodendron</i>\r\n\r\nHọ thực vật: <i>Araceae</i> (Ráy)\r\n\r\nChậu cây trầu bà có kích thước 25- 40 cm, thích hợp trang trí bàn làm việc, bàn khách, kệ tủ, tủ tài liệu, kệ sách,..\r\n\r\nCây trầu bà là một trong những loại thân dây leo, trông mềm mại và uyển chuyển. Lá trầu bà dạng hình tim, có loại xanh toàn phần, có loại có những đốm vàng trên lá.\r\n\r\n<a href=\"http://saigonhoa.com/wp-content/uploads/2014/05/la-cay-trau-ba-xanh.jpg\"><img class=\"alignnone  wp-image-5170\" src=\"http://saigonhoa.com/wp-content/uploads/2014/05/la-cay-trau-ba-xanh.jpg\" alt=\"la cay trau ba xanh\" width=\"261\" height=\"347\" /></a><a href=\"http://saigonhoa.com/wp-content/uploads/2014/04/cay-trau-ba-xanh1.jpg\"><img class=\"alignnone  wp-image-4264\" src=\"http://saigonhoa.com/wp-content/uploads/2014/04/cay-trau-ba-xanh1.jpg\" alt=\"cay trau ba xanh\" width=\"460\" height=\"346\" /></a>\r\n\r\nTrầu bà xanh hay còn gọi hoàng tâm diệp là loài cây lí tưởng giúp tạo ra bầu không khí trong lành. Nghiên cứu thực nghiệm chứng minh cây có thể làm giảm mức ô nhiễm ozone trong môi trường làm việc. Nó không chỉ có ý nghĩa về mặt sức khỏe, mà còn mang lại giá trị tinh thần vô giá.\r\n\r\nTrầu Bà sống trong môi trường râm mát, nhiệt độ thích hợp nhất từ 18 – 21 độ C, nên có thể trồng trong nhà, văn phòng, khách sạn …\r\n\r\nTrồng bụi cây vào chậu để bàn tạo sự mềm mại không gian như sau:\r\n\r\n<a href=\"http://saigonhoa.com/wp-content/uploads/2014/05/chau-trau-ba-de-ban.jpg\"><img class=\"alignnone  wp-image-5186\" src=\"http://saigonhoa.com/wp-content/uploads/2014/05/chau-trau-ba-de-ban.jpg\" alt=\"chau trau ba de ban\" width=\"429\" height=\"373\" /></a> <a href=\"http://saigonhoa.com/wp-content/uploads/2014/05/chau-cay-trau-ba-xanh-de-ban.jpg\"><img class=\"alignnone  wp-image-5187\" src=\"http://saigonhoa.com/wp-content/uploads/2014/05/chau-cay-trau-ba-xanh-de-ban.jpg\" alt=\"chau cay trau ba xanh de ban\" width=\"279\" height=\"372\" /></a>\r\n\r\nCây trầu bà dạng thân leo nên còn có thể được trồng vào các kiểu chậu treo, tạo nên nét đẹp quyến rủ, nhẹ nhàng:\r\n\r\n<a href=\"http://saigonhoa.com/wp-content/uploads/2014/05/chau-trau-ba-treo.jpg\"><img class=\"alignnone  wp-image-5189\" src=\"http://saigonhoa.com/wp-content/uploads/2014/05/chau-trau-ba-treo.jpg\" alt=\"chau trau ba treo\" width=\"301\" height=\"304\" /></a><a href=\"http://saigonhoa.com/wp-content/uploads/2014/04/cay-trau-ba-3.jpg\"><img class=\"alignnone  wp-image-2577\" src=\"http://saigonhoa.com/wp-content/uploads/2014/04/cay-trau-ba-3.jpg\" alt=\"cay trau ba\" width=\"407\" height=\"305\" /></a>\r\n\r\n&nbsp;\r\n\r\nTrầu bà là loại cây ưa ẩm và có sức sống khỏe, trồng bằng phương pháp thủy canh, cây sống cũng rất bền, ngoài ra, chúng tôi thường sử dụng trầu bà trồng tạo mảng xanh cho tường đứng – tường cây. Một tường cây rất “chất” với toàn trầu bà xanh:\r\n\r\n<a href=\"http://saigonhoa.com/wp-content/uploads/2014/05/tuong-cay-voi-trau-ba-xanh.jpg\"><img class=\"alignnone  wp-image-5208\" src=\"http://saigonhoa.com/wp-content/uploads/2014/05/tuong-cay-voi-trau-ba-xanh.jpg\" alt=\"tuong cay voi trau ba xanh\" width=\"652\" height=\"489\" /></a>\r\n\r\nNhân giống trầu bà xanh nhanh chóng bằng cách cắt một đoạn từ thân cây. Sau đó trồng phần thân cắt này vào đất xốt, đặt những chậu ươm cây trầu bà nơi có bóng râm khoảng 1- 2 tuần, tưới nước ngày 1 lần để giữ ẩm, cây sẽ nhanh chóng ra lá và phát triển đẹp. Với sự cần cù siêng năng – bản chất vốn có của những người làm vườn, yêu cây cảnh, việc tạo giống và sở hữu một vườn trầu bà xanh là khá dễ dàng.\r\n\r\n<a href=\"http://saigonhoa.com/wp-content/uploads/2014/05/vuon-cay-trau-ba-xanh.jpg\"><img class=\"alignnone  wp-image-5222\" src=\"http://saigonhoa.com/wp-content/uploads/2014/05/vuon-cay-trau-ba-xanh.jpg\" alt=\"vuon cay trau ba xanh\" width=\"658\" height=\"294\" /></a><img class=\"alignnone  wp-image-5221\" src=\"http://saigonhoa.com/wp-content/uploads/2014/05/chau-cay-trau-ba-xanh.jpg\" alt=\"chau cay trau ba xanh\" width=\"329\" height=\"439\" /> <a href=\"http://saigonhoa.com/wp-content/uploads/2014/04/cay-trau-ba-2.jpg\"><img class=\"alignnone  wp-image-2576\" src=\"http://saigonhoa.com/wp-content/uploads/2014/04/cay-trau-ba-2.jpg\" alt=\"cay trau ba\" width=\"330\" height=\"440\" /></a>\r\n\r\nChăm sóc chậu cây trầu bà để bàn rất đơn giản: tưới lượng nước đủ tạo ẩm cho giá thể của chậu cây (tùy theo chậu lớn hay nhỏ, thoát nước nhiều ít mà dùng lượng nước vừa đủ), tưới nước thường xuyên ngày 1 lần hoặc 2 ngày 1 lần. Đất trồng cây trầu bà xanh là loại đất xốp, có khả năng thoát nước tốt, giúp cây phát triển bền đẹp. Sau thời gian, chậu cây trầu bà có thể bị thiếu dưỡng chất, cây có thể hấp thụ dưỡng chất qua bộ lá, thân… do đó, chúng ta có thể sử dụng một số loại phân vi sinh chuyên cho lá cây để pha trong nước và xịt cho cây. Lưu ý nên chọn phân vi sinh để không ảnh hưởng đến sức khỏe và môi trường sinh hoạt của chúng ta.', 'Cây Trầu bà', '', 'publish', 'open', 'open', '', 'cay-trau-ba', '', '', '2015-11-10 09:46:13', '2015-11-10 02:46:13', '', 0, 'http://redep24.lavadep.com/?p=577', 0, 'post', '', 0),
(1002, 1, '2015-12-28 11:23:31', '2015-12-28 04:23:31', '<header class=\"article-header clearfix\">\r\n<h1>Các Bước Đặt Hàng Tại Redep24.com</h1>\r\n<div class=\"article-metadata\"></div>\r\n</header>\r\n<div class=\"article-body\">\r\n\r\n1. Tìm kiếm sản phẩm\r\n\r\n2. Thêm sản phẩm vào giỏ hàng\r\n\r\n3. Kiểm tra giỏ hàng và đặt hàng\r\n\r\n4. Đăng nhập hoặc đăng ký không cần tài khoản\r\n\r\n5. Điền địa chỉ giao hàng\r\n\r\n6. Chọn phương thức thanh toán và \"Đặt Mua\"\r\n\r\n7. Kiểm tra và xác nhận đơn hàng\r\n\r\n</div>', 'Các bước mua hàng', '', 'inherit', 'open', 'closed', '', '728-revision-v1', '', '', '2015-12-28 11:23:31', '2015-12-28 04:23:31', '', 728, 'http://redep24.lavadep.com/728-revision-v1/', 0, 'revision', '', 0),
(1003, 1, '2015-12-28 11:27:16', '2015-12-28 04:27:16', '<h3 class=\"upp\">Quy định đối với người mua</h3>\n<div class=\"desc_h2\">\n\nLà người mua, bạn có trách nhiệm đọc kỹ, hiểu và tuân thủ đúng những chính sách, quy định, điều khoản dành cho người mua. <strong>redep24.com</strong> có thể thay đổi những quy định này bất cứ lúc nào cần thiết. Những quy định mới sẽ có hiệu lực ngay khi được đăng tải lên <strong>redep24.com</strong>.\n\n<strong>redep24.com</strong> đưa ra những quy định này nhằm:\n\n-  Tạo dựng một môi trường mua bán an toàn, thuận lợi và thân thiện với mọi người dùng.\n\n- Giảm thiểu những rủi ro cho cả người bán và người mua.\n\n- Cung cấp cơ hội công bằng cho tất cả người mua.\n\n- Cung cấp kinh nghiệm mua hàng trực tuyến thú vị.\n\n<span style=\"text-decoration: underline;\"><strong>Quy định mua hàng</strong></span>\n\nTrước khi quyết định mua hàng, người mua cần hiểu rõ và tuân thủ những điều sau:\n\nHiểu và đồng ý  với những quy định về mua bán, giao dịch trên <strong>redep24.com</strong>.\n\nChỉ mua hàng khi chấp nhận và hiểu rõ những quy định trong tin đăng của người bán, không cố tình hiểu sai nhằm phá rối việc mua bán của người khác.Tìm hiểu kỹ các thông tin về sản phẩm, dịch vụ, người bán; tham khảo những thông tin từ người mua trước để có lựa chọn chính xác.Cung cấp đầy đủ và chính xác các thông tin cá nhân để phục vụ cho việc thanh toán và giao nhận hàng hóa.Không sử dụng hình thức thanh toán khi giao hàng để quấy rối, phá hoại việc kinh doanh của người khác.Thường xuyên theo dõi tình trạng đơn hàng của mình trên <strong>redep24.com</strong> hoặc tình trạng vận chuyển của lô hàng trên website  để có những xử lý kịp thời.\n\nTìm hiểu cách thức gửi khiếu nại và quy trình giải quyết khiếu nại của <strong>redep24.com</strong> cho những trường hợp có tranh chấp để được bảo vệ. Chủ động giữ liên lạc với người bán để giải đáp những thắc mắc về sản phẩm và việc giao nhận hàng. Liên lạc và gửi khiếu nại cho <strong>redep24.com</strong> trong những trường hợp người bán bất hợp tác hoặc có những phát sinh hai bên không đạt được thoả thuận..Chỉ mua hàng khi chấp nhận và hiểu rõ những quy định trong tin đăng của người bán, không cố tình hiểu sai nhằm phá rối việc mua bán của người khác.Tìm hiểu kỹ các thông tin về sản phẩm, dịch vụ, người bán; tham khảo những thông tin từ người mua trước để có lựa chọn chính xác.Cung cấp đầy đủ và chính xác các thông tin cá nhân để phục vụ cho việc thanh toán và giao nhận hàng hóa.Không sử dụng hình thức thanh toán khi giao hàng để quấy rối, phá hoại việc kinh doanh của người khác.Thường xuyên theo dõi tình trạng đơn hàng của mình trên Sendo hoặc tình trạng vận chuyển của lô hàng trên website để có những xử lý kịp thời.Tìm hiểu cách thức gửi khiếu nại và quy trình giải quyết khiếu nại của <strong>redep24.com</strong> cho những trường hợp có tranh chấp để được bảo vệ.Chủ động giữ liên lạc với người bán để giải đáp những thắc mắc về sản phẩm và việc giao nhận hàng.Liên lạc và gửi khiếu nại cho <strong>redep24.com</strong> trong những trường hợp người bán bất hợp tác hoặc có những phát sinh hai bên không đạt được thoả thuận..Chỉ mua hàng khi chấp nhận và hiểu rõ những quy định trong tin đăng của người bán, không cố tình hiểu sai nhằm phá rối việc mua bán của người khác.Tìm hiểu kỹ các thông tin về sản phẩm, dịch vụ, người bán; tham khảo những thông tin từ người mua trước để có lựa chọn chính xác.Cung cấp đầy đủ và chính xác các thông tin cá nhân để phục vụ cho việc thanh toán và giao nhận hàng hóa.Không sử dụng hình thức thanh toán khi giao hàng để quấy rối, phá hoại việc kinh doanh của người khác.Thường xuyên theo dõi tình trạng đơn hàng của mình trên Website hoặc tình trạng vận chuyển của lô hàng trên website  để có những xử lý kịp thời.Tìm hiểu cách thức gửi khiếu nại và quy trình giải quyết khiếu nại của <strong>redep24.com</strong> cho những trường hợp có tranh chấp để được bảo vệ.Chủ động giữ liên lạc với người bán để giải đáp những thắc mắc về sản phẩm và việc giao nhận hàng.Liên lạc và gửi khiếu nại cho <strong>redep24.com</strong> trong những trường hợp người bán bất hợp tác hoặc có những phát sinh hai bên không đạt được thoả thuận.\n\n</div>', 'Quy định mua hàng', '', 'inherit', 'open', 'closed', '', '22-autosave-v1', '', '', '2015-12-28 11:27:16', '2015-12-28 04:27:16', '', 22, 'http://redep24.lavadep.com/22-autosave-v1/', 0, 'revision', '', 0);
