(1006, 1, '2015-12-28 11:34:15', '2015-12-28 04:34:15', '<header class=\"article-header clearfix\">\r\n<h1>Cước Phí Đóng Gói &amp; Giao Hàng</h1>\r\n<div class=\"article-metadata\"></div>\r\n</header>\r\n<div class=\"article-body\">\r\n\r\n<span class=\"wysiwyg-color-black60 wysiwyg-font-size-medium\">Áp dụng từ ngày 01/12/2015.</span>\r\n\r\n<span class=\"wysiwyg-color-black\"><strong>Với dịch vụ giao hàng thường:</strong></span>\r\n\r\n<span class=\"wysiwyg-color-black wysiwyg-font-size-medium\">Đơn hàng sẽ được miễn phí \"Phí đóng gói và giao hàng\" khi:</span>\r\n<ul>\r\n	<li><span class=\"wysiwyg-color-black wysiwyg-font-size-medium\">Có giá trị trên <strong>150.000VNĐ</strong> ở khu vực TP. Hồ Chí Minh và Hà Nội.</span></li>\r\n</ul>\r\n<ul>\r\n	<li><span class=\"wysiwyg-color-black wysiwyg-font-size-medium\">Có giá trị trên <strong>250.000VNĐ</strong> ở các tỉnh thành khác trên toàn quốc.<strong>\r\n</strong></span></li>\r\n</ul>\r\n<div><span class=\"wysiwyg-font-size-medium\">Trong trường hợp trị giá đơn hàng chưa đủ mức miễn phí đóng gói và giao hàng, thì phí sẽ được áp dụng theo bảng dưới đây:</span></div>\r\n<div></div>\r\n<div></div>\r\n<table width=\"557\">\r\n<tbody>\r\n<tr>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\"><strong>Khối lượng</strong></span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\"><strong>Hồ Chí Minh\r\n</strong></span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\"><strong>Đà Nẵng-Hà Nội\r\n</strong></span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\"><strong>Miền Nam\r\n</strong></span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\"><strong>Miền Trung\r\n</strong></span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\"><strong>Miền Bắc\r\n</strong></span></td>\r\n</tr>\r\n<tr>\r\n<td cl