(1021, 20, '2015-12-31 12:38:12', '2015-12-31 05:38:12', '<strong>Nấm linh chi </strong>hẳn đã rất quen thuộc với nhiều bạn, nhưng lần này dưới bàn tay khéo léo, khả năng sáng tạo khi kết hợp nấm linh chi với các phụ kiện và vật dụng quen thuộc chúng tôi muốn gửi đến các bạn sản phẩm – <a title=\"Website Cây Chậu Treo Đồng Phát\" href=\"http://caychautreo.com/tieu-canh-linh-chi/\" target=\"_blank\"><em><strong>Tiểu cảnh linh chi</strong></em>.</a>\r\n\r\n<a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/12/tieu-canh-linh-chi-tien-canh-3.jpg\"><img class=\"size-medium wp-image-1020 aligncenter\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/12/tieu-canh-linh-chi-tien-canh-3-470x470.jpg\" alt=\"tieu-canh-linh-chi-tien-canh-3\" width=\"300\" height=\"300\" /></a>\r\n\r\n[caption id=\"attachment_1017\" align=\"aligncenter\" width=\"400\" class=\" \"]<a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/12/tieu-canh-linh-chi-tien-canh-4.jpg\"><img class=\"size-full wp-image-1017\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/12/tieu-canh-linh-chi-tien-canh-4.jpg\" alt=\"tieu-canh-linh-chi-tien-canh-4\" width=\"400\" height=\"400\" /></a> tieu-canh-linh-chi-tien-canh-4[/caption]\r\n\r\n<div class=\"pro_description\"><strong>Nấm linh chi, tên khoa học là Ganoderma lucidum, thuộc họ Nấm lim (Ganodermataceae). Nấm linh chi còn có những tên khác như Tiên thảo, Nấm trường thọ, Vạn niên nhung.</strong></div>\r\n<div class=\"pro_description\"><strong>Nấm Linh chi</strong> là một dược liệu mà con người từ xa xưa đã biết dùng làm thuốc. Trong \"Thần nông bản thảo\" xếp Linh chi vào loại siêu thượng phẩm hơn cả nhân sâm; trong \"Bản thảo cương mục\" coi Linh chi là loại thuốc quý, có tác dụng bảo can (bảo vệ gan), giải độc, cường tâm, kiện nảo (bổ óc), tiêu đờm, lợi niệu, ích vị (bổ dạ dày); gần đây các nhà khoa học Trung Quốc và Nhật phát hiện nấm linh chi còn có tác dụng phòng và chống ung thư, chống lão hóa làm tăng tuổi thọ.</div>\r\n<div class=\"pro_description\"><a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/12/tieu-canh-linh-chi-tien-canh-2.jpg\"><img class=\"size-medium wp-image-1019 aligncenter\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/12/tieu-canh-linh-chi-tien-canh-2-470x470.jpg\" alt=\"tieu-canh-linh-chi-tien-canh-2\" width=\"300\" height=\"300\" /></a></div>\r\n<div class=\"pro_description\"></div>\r\n<div class=\"pro_description\">\r\n\r\nLinh Chi được cắm trong những chiếc chậu sứ kết hợp với những viên đá, thú mô phỏng phong phú màu sắc và khung cảnh sẽ mang đến vẻ đẹp, mộc mạc, bình dị nhưng vẫn toát lên nét  thanh quý cho bàn làm việc, tiếp khách của bạn.Chắc chắn bạn sẽ gây đc ngạc nhiên cho đối tác, đồng nghiệp khi họ có ý tò mò nơi làm việc của bạn.\r\n\r\nNgoài ra, mỗi cây Nấm Linh Chi còn mang thông điệp riêng, là <a title=\"Quà Tết 2016\" href=\"http://redep24.lavadep.com/hang-tet-2016/\" target=\"_blank\">món quà ý nghĩa</a> gửi tặng người thân, bạn bè, đối tác nhân dịp đặc biệt.Gửi  đến các bạn sản phẩm này như một lời chúc làm ăn phát đạt, thịnh vượng và tràn đầy sức khỏe cho mọi \"mặt trận\".\r\n\r\n<a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/12/tieu-canh-linh-chi-tien-canh-1.jpg\"><img class=\"size-medium wp-image-1018 aligncenter\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/12/tieu-canh-linh-chi-tien-canh-1-470x470.jpg\" alt=\"tieu-canh-linh-chi-tien-canh-1\" width=\"300\" height=\"300\" /></a>\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n</div>', 'Tiểu cảnh Linh Chi  để bàn', '', 'inherit', 'open', 'closed', '', '1016-revision-v1', '', '', '2015-12-31 12:38:12', '2015-12-31 05:38:12', '', 1016, 'http://redep24.lavadep.com/1016-revision-v1/', 0, 'revision', '', 0),
