(939, 1, '2015-12-28 11:39:00', '2015-12-28 04:39:00', '<span style=\"color: #ff9900;\"><strong>1. Nhận hàng  tại nhà và thanh toán khi nhận hàng (hay còn gọi thanh toán  COD)</strong></span>\n\n-  Đối với khách hàng ở Tp.Hồ Chí Minh: không tính phí COD\n\n-  Đối với khách hàng ở tỉnh: tính phí COD bằng 1.5~2% trên tổng giá trị đơn hàng (phí thu hộ tại nhà)\n\n<span style=\"color: #ff9900;\"><strong>2. Thanh toán qua ngân hàng</strong></span>\n\na)<b>    </b>Quý khách có thể thanh toán bằng cách <b>chuyển khoản qua máy ATM</b>, sử dụng <b>Internet Banking</b> (chuyển tiền qua mạng Internet) hoặc <b>trực tiếp nộp tiền tại chi nhánh ngân hàng gần nhất.</b>\n\nb)    Thông tin tên người gửi tiền phải thống nhất với thông tin quý khách đã nhập khi đăng ký đặt hàng. Trường hợp tên người nộp tiền khác với thông tin quý khách đã nhập khi đăng ký mua hàng thì quý khách vui lòng liên hệ trực tiếp với Bộ phận Chăm sóc Khách hàng để được hỗ trợ giải quyết.\n\nc)     Quý khách vui lòng <b>kiểm tra kỹ số tiền đặt hàng (</b>đúng và đủ<b>)</b> trước khi chuyển khoản cho  chúng tôi\n\nd)    Quý khách có thể chuyển khoản cho Chúng tôi  dựa theo thông tin ngân hàng sau:\n<table class=\"aligncenter\" style=\"height: 312px;\" border=\"1\" width=\"823\" cellspacing=\"0\" cellpadding=\"0\">\n<tbody>\n<tr>\n<td valign=\"top\" width=\"37\">\n<p align=\"center\"><b>Stt</b></p>\n</td>\n<td valign=\"top\" width=\"126\">\n<p align=\"center\"><b>Ngân hàng</b></p>\n</td>\n<td valign=\"top\" width=\"168\">\n<p align=\"center\"><b>Số tài khoản</b></p>\n</td>\n<td valign=\"top\" width=\"277\">\n<p align=\"center\"><b>Chủ tài khoản</b></p>\n</td>\n</tr>\n<tr>\n<td valign=\"top\" width=\"37\">\n<p align=\"center\">1</p>\n</td>\n<td valign=\"top\" width=\"126\">\n<p align=\"center\">ACB</p>\n<p align=\"center\">(<em><em> CN Cộng Hòa - Tp.HCM</em></em>)</p>\n</td>\n<td valign=\"top\" width=\"168\">\n<p align=\"center\">199 858 059</p>\n</td>\n<td valign=\"top\" width=\"277\">\n<p align=\"center\">Hồ Ngọc Huy</p>\n<p align=\"center\"> (ĐT: 0977 629 090)</p>\n</td>\n</tr>\n<tr>\n<td valign=\"top\" width=\"37\">\n<p align=\"center\">2</p>\n</td>\n<td valign=\"top\" width=\"126\">\n<p align=\"center\">Vietcombank</p>\n<p align=\"center\">(CN Bình Tây<em>- Tp.HCM</em>)</p>\n</td>\n<td valign=\"top\" width=\"168\">\n<p align=\"center\">0251 0026 63801</p>\n</td>\n<td valign=\"top\" width=\"277\">\n<p align=\"center\"> Trịnh Đình Bình</p>\n<p align=\"center\"> (ĐT : 0909 874 825)</p>\n</td>\n</tr>\n<tr>\n<td valign=\"top\" width=\"37\"> 3</td>\n<td valign=\"top\" width=\"126\">      Agribank An Phú</td>\n<td valign=\"top\" width=\"168\">  1606 2010 42161</td>\n<td style=\"text-align: right;\" valign=\"top\" width=\"277\">    Công Ty TNHH GMC Á Châu(ĐT : 08 668 47 668)</td>\n</tr>\n</tbody>\n</table>\n<strong><span style=\"color: #ff9900;\"> 3 - Xác nhận đã thanh toán:</span></strong>\n\nNgay sau khi thanh toán thành công, quý khách có thể gọi điện thông báo tới chúng tôi để xác nhận hoặc chụp hình giao diện hóa đơn thanh toán thành công và gửi về cho chúng tôi theo địa chỉ email:  redep24h@gmail.com.\n\n<span style=\"color: #ff9900;\"><strong>4 - Chúng tôi xác nhận thanh toán:</strong></span>\n\nNgay sau khi nhận được thông báo thanh toán từ khách hàng, nhân viên của chúng tôi sẽ nhanh chóng xác thực và thông tin cho khách hàng trong thời gian sớm nhất ngày làm việc trong tuần từ thứ 2 đến thứ 6.\n\nTrường hợp khách hàng thanh toán vào cuối tuần hoặc các ngày nghĩ lễ, chúng tôi sẽ tiến hành xác nhận trong ngày làm việc đầu tiên của tuần kế tiếp.\n\n<span style=\"color: #ff9900;\"><strong>5 - Trường hợp không thể chuyển hàng vì một vài lý do</strong></span>\n\nTrong trường hợp chúng tôi xác nhận đã hết hàng , hay vì lý do khác mà chúng tôi không thể chuyển hàng tới quý khách. thì chúng tôi sẽ có trách nhiệm hoàn tiền lại và thông báo cho quý khách.\n\nChúc quý khách có những trãi nghiệm thú vị tại www.redep24.com\n\n&nbsp;', 'Cách thức thanh toán', '', 'inherit', 'open', 'closed', '', '732-autosave-v1', '', '', '2015-12-28 11:39:00', '2015-12-28 04:39:00', '', 732, 'http://redep24.lavadep.com/732-autosave-v1/', 0, 'revision', '', 0),
(938, 16, '2015-12-10 21:21:48', '2015-12-10 14:21:48', '&nbsp;\r\n\r\n[caption id=\"attachment_930\" align=\"alignleft\" width=\"300\" class=\" \"]<a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/12/dau-phong-rang-toi-ot-re-dep-24.png\"><img class=\"size-medium wp-image-930\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/12/dau-phong-rang-toi-ot-re-dep-24-470x470.png\" alt=\"dau-phong-rang-toi-ot-re-dep-24\" width=\"300\" height=\"300\" /></a> dau-phong-rang-toi-ot-re-dep-24[/caption]\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\nĐậu phộng rang Tỏj Ớt là sự kết hợp tinh tế để tạo ra sản phẩm Tốt cho sức khỏe của người sử dụng p@n nhé\r\n\r\nĂn tỏi sống chữa nhiều bệnh\r\n\r\nKhi sử dụng tỏi với mục đích y học, không nên để nguyên củ mà cần nhai hoặc nghiền nát và nên ăn sống vì tỏi nấu chín sẽ bị giảm tác dụng.\r\n\r\nDưới đây là một số công dụng chính của tỏi đối với sức khoẻ con người:\r\n-  Tác dụng đối với hệ tim mạch\r\n\r\n- Tác dụng chống ung thư\r\n\r\n- Tác dụng kháng khuẩn\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n<a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/12/Dau-phong-toi-ot-re-dep-24.png\"><img class=\"alignnone size-medium wp-image-932\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/12/Dau-phong-toi-ot-re-dep-24-470x470.png\" alt=\"Dau-phong-toi-ot-re-dep-24\" width=\"300\" height=\"300\" /></a><a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/12/Sieu-thi.jpg\"><img class=\"alignnone size-full wp-image-934\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/12/Sieu-thi.jpg\" alt=\"Sieu thi\" width=\"420\" height=\"281\" /></a>\r\n\r\n<a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/12/Thap-dau-phong.png\"><img class=\"alignnone size-medium wp-image-937\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/12/Thap-dau-phong-470x470.png\" alt=\"Thap dau phong rang toi ot\" width=\"300\" height=\"300\" /></a><a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/12/Hu-dau-phong.jpg\"><img class=\"alignnone size-medium wp-image-933\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/12/Hu-dau-phong-470x470.jpg\" alt=\"hu dau phong rang toi ot re dep\" width=\"300\" height=\"300\" /></a>', 'Đậu phộng rang tỏi ớt', '', 'inherit', 'open', 'closed', '', '929-revision-v1', '', '', '2015-12-10 21:21:48', '2015-12-10 14:21:48', '', 929, 'http://redep24.lavadep.com/929-revision-v1/', 0, 'revision', '', 0),
(794, 1, '2015-02-01 15:30:32', '2015-02-01 08:30:32', '[caption id=\"attachment_799\" align=\"aligncenter\" width=\"300\"]<a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/02/rau-cu-qua-say-kho-dalat-05.jpg\"><img class=\"wp-image-799 size-medium\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/02/rau-cu-qua-say-kho-dalat-05-470x470.jpg\" alt=\"Rau củ quả sấy Đà Lạt, miếng chất lượng\" width=\"300\" height=\"300\" /></a> Rau củ quả sấy Đà Lạt, miếng chất lượng[/caption]\r\n\r\nĐược chế biến từ các loại Rau, Củ, Quả xanh ngon của Đà Lạt như: chuối, khoai lang, đậu cove, đậu đũa, thơm, mít, cà rốt, củ dền, cà tím, đậu bắp, … Đặc biệt là không bị nát và đóng đường phía trên. Miếng sấy được giữ hầu như nguyên vẹn.\r\n\r\nTHẬP CẨM SẤY là món rau củ thập cẩm sấy giòn mà du khách Đà Lạt nào cũng yêu thích. Rau củ được sấy giòn tan nhưng vẫn giữ được hương vị của từng loại riêng biệt.\r\n\r\n- Mít sấy khô\r\n\r\n- Khoai lang tím sấy khô\r\n\r\n- Khoai lang sấy\r\n\r\n- Khoai môn sấy\r\n\r\n- Khoai lang gừng\r\n\r\n- Khoai lang dẻo\r\n\r\n[caption id=\"attachment_798\" align=\"aligncenter\" width=\"300\"]<a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/02/rau-cu-qua-say-kho-dalat-04.jpg\"><img class=\"wp-image-798 size-medium\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/02/rau-cu-qua-say-kho-dalat-04-470x462.jpg\" alt=\"rau-cu-qua-say-kho-dalat-04\" width=\"300\" height=\"294\" /></a> Rau củ quả sấy Đà Lạt, miếng to chất lượng[/caption]', 'Rau củ quả sấy Dalat', '', 'publish', 'open', 'open', '', 'rau-cu-qua-say-dalat', '', '', '2015-11-21 11:28:11', '2015-11-21 04:28:11', '', 0, 'http://redep24.lavadep.com/?p=794', 0, 'post', '', 0),
