(539, 3, '2014-12-22 19:30:13', '2014-12-22 12:30:13', '<div>Như tên gọi của nó<strong> Cây Đại phú gia</strong> hay đại phú quý, đại phú..loài cây này mang ý nghĩa tốt về phong thủy, mang lại tiền tài và sức khỏe cho gia chủ</div>\r\n<div></div>\r\n<div><strong>Cây đại phú gia</strong> chịu bóng, ưa khí hậu mát mẻ, phù hợp trồng trong nhà, văn phòng, tiền sảnh...</div>\r\n<div></div>\r\n<div>Cây sống khỏe, dễ chăm sóc.</div>\r\n<div></div>\r\n<div>Làm không gian xanh tươi, tạo sự cân bằng giữa thiên nhiên và con người.</div>\r\n<div></div>\r\n<div>Giúp thanh lọc không khí để có môi trường làm việc và sống dễ chịu nhất.</div>\r\n<div></div>\r\n<div>Điều hòa nhiệt độ, không khí cho không gian của bạn.</div>\r\n<div></div>\r\n<div>Có thể trồng làm cảnh hoặc làm quà tặng.</div>\r\n<div></div>\r\n<div><strong>Cây Đại phú gia</strong> không chỉ mang ý nghĩa về phong thủy, mang lại tiền tài và sức khỏe. Ngoài ra cây dùng để trang trí nội thất trong nhà sẽ làm không gian trong nhà xanh và tạo sự cân bằng giữa thiên nhiên và con người .</div>\r\n<div></div>\r\n<div> <strong>Cây đại phú gia</strong> có nguồn gốc xuất xứ từ vùng nhiệt đới châu Á</div>\r\n<div></div>\r\n<div>Lá trải dài từ gốc, tập trung nhiều ở ngọn cây. Lá dạng bầu dục hơi thuôn nhọn đầu, cuốn mập, có bẹ ôm thân. Lá màu xanh bóng dày, gân lông chim.</div>\r\n<div></div>\r\n<div>Đại phú gia có lá to màu xanh thẫm. Thân cây to và nhiều nước. Cây đã dưỡng lâu trong chậu nên sẽ bền và đẹp hơn. Làm cây cảnh văn phòng rất bền và đẹp.</div>\r\n<div></div>\r\n<div>Cây ưa thích ánh sáng bán phần, thích hợp trang trí nội thất, văn phòng, tiền sảnh…</div>\r\n<div></div>\r\n<div><strong>Đại phú gia</strong> có thể đặt ở nơi ánh sáng bán phần, nơi giao thông chung như khu vực nhiều người đi lại như cầu thang, hành lang…</div>\r\n<div></div>\r\n<div>Cây có thân mập, tròn. Có thể cao 1-2m.</div>\r\n<div></div>\r\n<div>Thông thường cây đại phú, sau khi được nuôi trồng từ 09 tháng- 1 năm sẽ cho được 06-08 lá, chiều cao từ 60cm – 80cm.</div>\r\n<div></div>\r\n<div><img src=\"http://thegioicayxanh.vn/image/data/cay-noi-that/2.jpg\" alt=\"\" /><img src=\"http://thegioicayxanh.vn/image/data/cay-noi-that/i%20ph%C4%82%C2%BA%20gia.JPG\" alt=\"\" /></div>\r\n<div></div>\r\n<div><strong>Cây đại phú</strong> gia có tán lá khá lớn xanh mướt rất ưa nhìn… và hiện nay là sự lựa chọn nhiều nhất của một số khách hàng thuê cây văn phòng trong TP.HCM.</div>\r\n<div></div>\r\n<div>Cây đại phú gia trổ bông, mùi hương rất nồng giống như mùi sâm. Bông của cây đại phú gia mầu trắng được bao bọc bởi ống giống như chiếc lá non mới.</div>\r\n<div></div>\r\n<div>Khi để trong lâu trong nhà, cây có các biểu hiện vàng lá, héo úa, thậm chí thối gốc. Cách khắc phụ như sau:</div>\r\n<div></div>\r\n<div><em><strong>Tham khảo Hướng Dẫn Chăm Sóc Cây Đại Phú Gia:</strong> </em></div>\r\n<div></div>\r\n<div>Nếu cây đại phú gia được dùng trong phòng máy lạnh, thì thỉnh thoảng phải đưa ra ngoài hứng nắng cho cây, trung bình 1 tuần khoảng vài lần, để cây quang hợp và giúp lá cây xanh tươi hơn, bên cạnh đó việc tưới nước cũng được thực hiện khoảng 5 ngày 1 lần cho cây..</div>\r\n<div></div>\r\n<div>Thời gian đầu có thể chưa cần bón phân cho cây, khoảng 1 tháng - 1.5 tháng thì nên mua phân về bổ sung dinh dưỡng.. giúp cây sống khỏe và xanh tốt..</div>\r\n<div></div>\r\n<div>Không nên để cây trong nhà, trong phòng kín quá lâu, cây dễ đổ bệnh, bạn chỉ nên để cây nội thất trong nhà 2 tuần, tối đa 1 tháng là phải đem cây ra ngoài trời, nơi râm mát để cây hồi phục.</div>\r\n<div></div>\r\n<div>Khi phát hiện cây có hiện tượng lá vàng cần hay lá bị đốm cần kiên quyết cắt bỏ. Khi cây có biểu hiện hồi phục, ra lá mới, các lá cũ đã lấy lại được sức căng, không bị rũ xuống nữa. Đấy mới là thời điểm thích hợp để bón phân hay phun thuốc cho cây. Đơn giản và dễ kiếm nhất là sử dụng phân vi sinh.</div>\r\n<div></div>\r\n<div>Tuyệt đối không bón cây bằng nước vo gạo hay bã chè.</div>', 'Cây đại phú gia', '', 'publish', 'open', 'open', '', 'cay-dai-phu-gia', '', '', '2015-11-10 09:48:15', '2015-11-10 02:48:15', '', 0, 'http://redep24.lavadep.com/?p=539', 0, 'post', '', 0),
