(728, 1, '2015-01-21 22:17:15', '2015-01-21 15:17:15', '<header class=\"article-header clearfix\">\r\n<h1>Các Bước Đặt Hàng Tại Redep24.com</h1>\r\n<div class=\"article-metadata\"></div>\r\n</header>\r\n<div class=\"article-body\">\r\n\r\n1. Tìm kiếm sản phẩm\r\n\r\n2. Thêm sản phẩm vào giỏ hàng\r\n\r\n3. Kiểm tra giỏ hàng và đặt hàng\r\n\r\n4. Đăng nhập hoặc đăng ký không cần tài khoản\r\n\r\n5. Điền địa chỉ giao hàng\r\n\r\n6. Chọn phương thức thanh toán và \"Đặt Mua\"\r\n\r\n7. Kiểm tra và xác nhận đơn hàng\r\n\r\n</div>', 'Các bước mua hàng', '', 'publish', 'open', 'open', '', 'cac-buoc-mua-hang', '', '', '2015-12-28 11:24:45', '2015-12-28 04:24:45', '', 0, 'http://redep24.lavadep.com/?page_id=728', 0, 'page', '', 0),
(730, 1, '2015-01-21 22:18:07', '2015-01-21 15:18:07', '<header class=\"article-header clearfix\">\r\n<h1>Cước Phí Đóng Gói &amp; Giao Hàng</h1>\r\n<div class=\"article-metadata\"></div>\r\n</header>\r\n<div class=\"article-body\">\r\n\r\n<span class=\"wysiwyg-color-black60 wysiwyg-font-size-medium\">Áp dụng từ ngày 01/12/2015.</span>\r\n\r\n<span class=\"wysiwyg-color-black\"><strong>Với dịch vụ giao hàng thường:</strong></span>\r\n\r\n<span class=\"wysiwyg-color-black wysiwyg-font-size-medium\">Đơn hàng sẽ được miễn phí \"Phí đóng gói và giao hàng\" khi:</span>\r\n<ul>\r\n	<li><span class=\"wysiwyg-color-black wysiwyg-font-size-medium\">Có giá trị trên <strong>150.000VNĐ</strong> ở khu vực TP. Hồ Chí Minh và Hà Nội.</span></li>\r\n</ul>\r\n<ul>\r\n	<li><span class=\"wysiwyg-color-black wysiwyg-font-size-medium\">Có giá trị trên <strong>250.000VNĐ</strong> ở các tỉnh thành khác trên toàn quốc.<strong>\r\n</strong></span></li>\r\n</ul>\r\n<div><span class=\"wysiwyg-font-size-medium\">Trong trường hợp trị giá đơn hàng chưa đủ mức miễn phí đóng gói và giao hàng, thì phí sẽ được áp dụng theo bảng dưới đây:</span></div>\r\n<div></div>\r\n<div></div>\r\n<table width=\"557\">\r\n<tbody>\r\n<tr>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\"><strong>Khối lượng</strong></span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\"><strong>Hồ Chí Minh\r\n</strong></span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\"><strong>Đà Nẵng-Hà Nội\r\n</strong></span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\"><strong>Miền Nam\r\n</strong></span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\"><strong>Miền Trung\r\n</strong></span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\"><strong>Miền Bắc\r\n</strong></span></td>\r\n</tr>\r\n<tr>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">0 – 500g</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">10.000</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">14.000</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">13.000</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">16.000</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">18.000</span></td>\r\n</tr>\r\n<tr>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">501 – 1000g</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">12.000</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">17.000</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">16.000</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">20.000</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">22.000</span></td>\r\n</tr>\r\n<tr>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">1001 – 2000g</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">14.000</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">21.000</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">20.000</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">26.000</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">27.000</span></td>\r\n</tr>\r\n<tr>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">2001 – 3000g</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">16.000</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">25.000</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">24.000</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">32.000</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">32.000</span></td>\r\n</tr>\r\n<tr>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">3001 – 4000g</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">18.000</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">28.000</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">27.000</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">36.000</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">36.000</span></td>\r\n</tr>\r\n<tr>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">4001 – 5000g</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">20.000</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">30.000</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">30.000</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">40.000</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">40.000</span></td>\r\n</tr>\r\n<tr>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">Mỗi kg kế tiếp</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">+2.000</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">+2.000</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">+3.000</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">+3.000</span></td>\r\n<td class=\"wysiwyg-text-align-center\"><span class=\"wysiwyg-font-size-medium\">+3.000</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;\r\n\r\n<strong>Với dịch vụ giao hàng 24H:</strong>\r\n\r\nVới đa số các đơn hàng, cước phí Giao Hàng 24H là <strong>24.000 đồng</strong>. Với đơn hàng từ 500.000 đồng trở lên\r\n<table width=\"552\">\r\n<tbody>\r\n<tr>\r\n<td><span class=\"wysiwyg-font-size-medium\"><strong>Khối lượng</strong></span></td>\r\n<td><span class=\"wysiwyg-font-size-medium\"><strong>Phí Giao Hàng 24H (đồng)</strong></span></td>\r\n</tr>\r\n<tr>\r\n<td><span class=\"wysiwyg-font-size-medium\">0 - 500 gram</span></td>\r\n<td><span class=\"wysiwyg-font-size-medium\">24.000</span></td>\r\n</tr>\r\n<tr>\r\n<td><span class=\"wysiwyg-font-size-medium\">500 - 1000 gram</span></td>\r\n<td><span class=\"wysiwyg-font-size-medium\">30.000</span></td>\r\n</tr>\r\n<tr>\r\n<td><span class=\"wysiwyg-font-size-medium\">1000 - 2000 gram</span></td>\r\n<td><span class=\"wysiwyg-font-size-medium\">35.000</span></td>\r\n</tr>\r\n<tr>\r\n<td><span class=\"wysiwyg-font-size-medium\">2000 - 3000 gram</span></td>\r\n<td><span class=\"wysiwyg-font-size-medium\">40.000</span></td>\r\n</tr>\r\n<tr>\r\n<td><span class=\"wysiwyg-font-size-medium\">3000 - 4000 gram</span></td>\r\n<td><span class=\"wysiwyg-font-size-medium\">45.000</span></td>\r\n</tr>\r\n<tr>\r\n<td><span class=\"wysiwyg-font-size-medium\">4000 - 5000 gram</span></td>\r\n<td><span class=\"wysiwyg-font-size-medium\">50.000</span></td>\r\n</tr>\r\n<tr>\r\n<td><span class=\"wysiwyg-font-size-medium\">Mỗi kilogram cộng thêm</span></td>\r\n<td><span class=\"wysiwyg-font-size-medium\">+4.000</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;\r\n\r\n<strong>Bảng liệt kê các tỉnh trực thuộc khu vực:</strong>\r\n<table width=\"560\">\r\n<tbody>\r\n<tr>\r\n<td><span class=\"wysiwyg-font-size-medium\"><strong>Miền Nam</strong></span></td>\r\n<td><span class=\"wysiwyg-font-size-medium\">An Giang, Bình Dương, Bình Phước, Bà Rịa- Vũng Tàu, Bạc Liêu, Bến Tre, Bình Thuận, Cà Mau, Cần Thơ, Đồng Nai, Đồng Tháp, Hậu Giang, Kiên Giang, Long An, Lâm Đồng, Ninh Thuận, Sóc Trăng, Tây Ninh, Tiền Giang, Trà Vinh, Vĩnh Long, Khánh Hòa.\r\n</span></td>\r\n</tr>\r\n<tr>\r\n<td><span class=\"wysiwyg-font-size-medium\"><strong>Miền Trung</strong></span></td>\r\n<td><span class=\"wysiwyg-font-size-medium\">Đắk Lắk, Đắk Nông, Bình Định, Gia Lai, Huế, Kon Tum, Phú Yên, Quảng Trị, Quảng Nam, Quảng Ngãi.\r\n</span></td>\r\n</tr>\r\n<tr>\r\n<td><span class=\"wysiwyg-font-size-medium\"><strong>Miền Bắc</strong></span></td>\r\n<td><span class=\"wysiwyg-font-size-medium\">Quảng Bình, Bắc Kạn, Bắc Giang, Bắc Ninh, Cao Bằng, Điện Biên, Hà Giang, Hà Nam, Hà Tĩnh, Hải Dương, Hải Phòng, Hưng Yên, Hoà Bình, Lào Cai, Lai Châu, Lạng Sơn, Nam Định, Nghệ An, Ninh Bình, Phú Thọ, Quảng Ninh, Sơn La, Thái Bình, Thái Nguyên, Thanh Hóa, Tuyên Quang, Vĩnh Phúc, Yên Bái.</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>', 'Phương thức vận chuyển', '', 'publish', 'open', 'open', '', 'phuong-thuc-van-chuyen', '', '', '2015-12-28 11:34:15', '2015-12-28 04:34:15', '', 0, 'http://redep24.lavadep.com/?page_id=730', 0, 'page', '', 0),
(732, 1, '2015-01-21 22:18:24', '2015-01-21 15:18:24', '<span style=\"color: #ff9900;\"><strong>1. Nhận hàng  tại nhà và thanh toán khi nhận hàng (hay còn gọi thanh toán  COD)</strong></span>\r\n\r\n-  Đối với khách hàng ở Tp.Hồ Chí Minh: không tính phí COD\r\n\r\n-  Đối với khách hàng ở tỉnh: tính phí COD bằng 1.5~2% trên tổng giá trị đơn hàng (phí thu hộ tại nhà)\r\n\r\n<span style=\"color: #ff9900;\"><strong>2. Thanh toán qua ngân hàng</strong></span>\r\n\r\na)<b>    </b>Quý khách có thể thanh toán bằng cách <b>chuyển khoản qua máy ATM</b>, sử dụng <b>Internet Banking</b> (chuyển tiền qua mạng Internet) hoặc <b>trực tiếp nộp tiền tại chi nhánh ngân hàng gần nhất.</b>\r\n\r\nb)    Thông tin tên người gửi tiền phải thống nhất với thông tin quý khách đã nhập khi đăng ký đặt hàng. Trường hợp tên người nộp tiền khác với thông tin quý khách đã nhập khi đăng ký mua hàng thì quý khách vui lòng liên hệ trực tiếp với Bộ phận Chăm sóc Khách hàng để được hỗ trợ giải quyết.\r\n\r\nc)     Quý khách vui lòng <b>kiểm tra kỹ số tiền đặt hàng (</b>đúng và đủ<b>)</b> trước khi chuyển khoản cho  chúng tôi\r\n\r\nd)    Quý khách có thể chuyển khoản cho Chúng tôi  dựa theo thông tin ngân hàng sau:\r\n<table class=\"aligncenter\" style=\"height: 312px;\" border=\"1\" width=\"823\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td valign=\"top\" width=\"37\">\r\n<p align=\"center\"><b>Stt</b></p>\r\n</td>\r\n<td valign=\"top\" width=\"126\">\r\n<p align=\"center\"><b>Ngân hàng</b></p>\r\n</td>\r\n<td valign=\"top\" width=\"168\">\r\n<p align=\"center\"><b>Số tài khoản</b></p>\r\n</td>\r\n<td valign=\"top\" width=\"277\">\r\n<p align=\"center\"><b>Chủ tài khoản</b></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign=\"top\" width=\"37\">\r\n<p align=\"center\">1</p>\r\n</td>\r\n<td valign=\"top\" width=\"126\">\r\n<p align=\"center\">ACB</p>\r\n<p align=\"center\">(<em><em> CN Cộng Hòa - Tp.HCM</em></em>)</p>\r\n</td>\r\n<td valign=\"top\" width=\"168\">\r\n<p align=\"center\">199 858 059</p>\r\n</td>\r\n<td valign=\"top\" width=\"277\">\r\n<p align=\"center\">Hồ Ngọc Huy</p>\r\n<p align=\"center\"> (ĐT: 0977 62 9090)</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign=\"top\" width=\"37\">\r\n<p align=\"center\">2</p>\r\n</td>\r\n<td valign=\"top\" width=\"126\">\r\n<p align=\"center\">Vietcombank</p>\r\n<p align=\"center\">(CN Bình Tây<em>- Tp.HCM</em>)</p>\r\n</td>\r\n<td valign=\"top\" width=\"168\">\r\n<p align=\"center\">0251 0026 63801</p>\r\n</td>\r\n<td valign=\"top\" width=\"277\">\r\n<p align=\"center\"> Trịnh Đình Bình</p>\r\n<p align=\"center\"> (ĐT : 0909 874 825)</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign=\"top\" width=\"37\"> 3</td>\r\n<td valign=\"top\" width=\"126\">      Agribank An Phú</td>\r\n<td valign=\"top\" width=\"168\">  1606 2010 42161</td>\r\n<td valign=\"top\" width=\"277\">               Công Ty TNHH GMC Á Châu                    (ĐT : 08 668 47 668)</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<strong><span style=\"color: #ff9900;\"> 3 - Xác nhận đã thanh toán:</span></strong>\r\n\r\nNgay sau khi thanh toán thành công, quý khách có thể gọi điện thông báo tới chúng tôi để xác nhận hoặc chụp hình giao diện hóa đơn thanh toán thành công và gửi về cho chúng tôi theo địa chỉ email:  redep24h@gmail.com.\r\n\r\n<span style=\"color: #ff9900;\"><strong>4 - Chúng tôi xác nhận thanh toán:</strong></span>\r\n\r\nNgay sau khi nhận được thông báo thanh toán từ khách hàng, nhân viên của chúng tôi sẽ nhanh chóng xác thực và thông tin cho khách hàng trong thời gian sớm nhất ngày làm việc trong tuần từ thứ 2 đến thứ 6.\r\n\r\nTrường hợp khách hàng thanh toán vào cuối tuần hoặc các ngày nghĩ lễ, chúng tôi sẽ tiến hành xác nhận trong ngày làm việc đầu tiên của tuần kế tiếp.\r\n\r\n<span style=\"color: #ff9900;\"><strong>5 - Trường hợp không thể chuyển hàng vì một vài lý do</strong></span>\r\n\r\nTrong trường hợp chúng tôi xác nhận đã hết hàng , hay vì lý do khác mà chúng tôi không thể chuyển hàng tới quý khách. thì chúng tôi sẽ có trách nhiệm hoàn tiền lại và thông báo cho quý khách.\r\n\r\nChúc quý khách có những trãi nghiệm thú vị tại www.redep24.com\r\n\r\n&nbsp;', 'Cách thức thanh toán', '', 'publish', 'open', 'open', '', 'cach-thuc-thanh-toan', '', '', '2015-12-28 11:39:35', '2015-12-28 04:39:35', '', 0, 'http://redep24.lavadep.com/?page_id=732', 0, 'page', '', 0),
(940, 1, '2015-12-10 21:35:44', '2015-12-10 14:35:44', '<span style=\"color: #ff9900;\"><strong>1. Nhận hàng  tại nhà và thanh toán khi nhận hàng (hay còn gọi thanh toán  COD)</strong></span>\r\n\r\n-  Đối với khách hàng ở Tp.Hồ Chí Minh: không tính phí COD\r\n\r\n-  Đối với khách hàng ở tỉnh: tính phí COD bằng 1.5~2% trên tổng giá trị đơn hàng (phí thu hộ tại nhà)\r\n\r\n<span style=\"color: #ff9900;\"><strong>2. Thanh toán qua ngân hàng</strong></span>\r\n\r\na)<b>    </b>Quý khách có thể thanh toán bằng cách <b>chuyển khoản qua máy ATM</b>, sử dụng <b>Internet Banking</b> (chuyển tiền qua mạng Internet) hoặc <b>trực tiếp nộp tiền tại chi nhánh ngân hàng gần nhất.</b>\r\n\r\nb)    Thông tin tên người gửi tiền phải thống nhất với thông tin quý khách đã nhập khi đăng ký đặt hàng. Trường hợp tên người nộp tiền khác với thông tin quý khách đã nhập khi đăng ký mua hàng thì quý khách vui lòng liên hệ trực tiếp với Bộ phận Chăm sóc Khách hàng để được hỗ trợ giải quyết.\r\n\r\nc)     Quý khách vui lòng <b>kiểm tra kỹ số tiền đặt hàng (</b>đúng và đủ<b>)</b> trước khi chuyển khoản cho  chúng tôi\r\n\r\nd)    Quý khách có thể chuyển khoản cho Chúng tôi  dựa theo thông tin ngân hàng sau:\r\n<table class=\"aligncenter\" style=\"height: 312px;\" border=\"1\" width=\"823\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td valign=\"top\" width=\"37\">\r\n<p align=\"center\"><b>Stt</b></p>\r\n</td>\r\n<td valign=\"top\" width=\"126\">\r\n<p align=\"center\"><b>Ngân hàng</b></p>\r\n</td>\r\n<td valign=\"top\" width=\"168\">\r\n<p align=\"center\"><b>Số tài khoản</b></p>\r\n</td>\r\n<td valign=\"top\" width=\"277\">\r\n<p align=\"center\"><b>Chủ tài khoản</b></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign=\"top\" width=\"37\">\r\n<p align=\"center\">1</p>\r\n</td>\r\n<td valign=\"top\" width=\"126\">\r\n<p align=\"center\">ACB</p>\r\n<p align=\"center\">(<em><em> CN Cộng Hòa - Tp.HCM</em></em>)</p>\r\n</td>\r\n<td valign=\"top\" width=\"168\">\r\n<p align=\"center\">199 858 059</p>\r\n</td>\r\n<td valign=\"top\" width=\"277\">\r\n<p align=\"center\">Hồ Ngọc Huy</p>\r\n<p align=\"center\"> (ĐT: 0977 629 090)</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign=\"top\" width=\"37\">\r\n<p align=\"center\">2</p>\r\n</td>\r\n<td valign=\"top\" width=\"126\">\r\n<p align=\"center\">Vietcombank</p>\r\n<p align=\"center\">(CN Bình Tây<em>- Tp.HCM</em>)</p>\r\n</td>\r\n<td valign=\"top\" width=\"168\">\r\n<p align=\"center\">0251 0026 63801</p>\r\n</td>\r\n<td valign=\"top\" width=\"277\">\r\n<p align=\"center\"> Trịnh Đình Bình</p>\r\n<p align=\"center\"> (ĐT : 0909 874 825)</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign=\"top\" width=\"37\"> 3</td>\r\n<td valign=\"top\" width=\"126\">      Agribank An Phú</td>\r\n<td valign=\"top\" width=\"168\">  1606 2010 42161</td>\r\n<td valign=\"top\" width=\"277\">    Công Ty TNHH GMC Á Châu\r\n\r\n(ĐT : 08 668 47 668)</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<strong><span style=\"color: #ff9900;\"> 3 - Xác nhận đã thanh toán:</span></strong>\r\n\r\nNgay sau khi thanh toán thành công, quý khách có thể gọi điện thông báo tới chúng tôi để xác nhận hoặc chụp hình giao diện hóa đơn thanh toán thành công và gửi về cho chúng tôi theo địa chỉ email:  redep24h@gmail.com.\r\n\r\n<span style=\"color: #ff9900;\"><strong>4 - Chúng tôi xác nhận thanh toán:</strong></span>\r\n\r\nNgay sau khi nhận được thông báo thanh toán từ khách hàng, nhân viên của chúng tôi sẽ nhanh chóng xác thực và thông tin cho khách hàng trong thời gian sớm nhất ngày làm việc trong tuần từ thứ 2 đến thứ 6.\r\n\r\nTrường hợp khách hàng thanh toán vào cuối tuần hoặc các ngày nghĩ lễ, chúng tôi sẽ tiến hành xác nhận trong ngày làm việc đầu tiên của tuần kế tiếp.\r\n\r\n<span style=\"color: #ff9900;\"><strong>5 - Trường hợp không thể chuyển hàng vì một vài lý do</strong></span>\r\n\r\nTrong trường hợp chúng tôi xác nhận đã hết hàng , hay vì lý do khác mà chúng tôi không thể chuyển hàng tới quý khách. thì chúng tôi sẽ có trách nhiệm hoàn tiền lại và thông báo cho quý khách.\r\n\r\nChúc quý khách có những trãi nghiệm thú vị tại www.redep24.com\r\n\r\n&nbsp;', 'Cách thức thanh toán', '', 'inherit', 'open', 'closed', '', '732-revision-v1', '', '', '2015-12-10 21:35:44', '2015-12-10 14:35:44', '', 732, 'http://redep24.lavadep.com/732-revision-v1/', 0, 'revision', '', 0),
(824, 3, '2015-02-10 17:31:17', '2015-02-10 10:31:17', 'Hạc Đỉnh là loài hoa rất lý tưởng để trang trí các phòng khách, phòng họp có không gian rộng.\r\n\r\n[caption id=\"attachment_828\" align=\"aligncenter\" width=\"300\"]<a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/02/dia-lan-hac-dinh-dalat-04.jpg\"><img class=\"wp-image-828 size-medium\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/02/dia-lan-hac-dinh-dalat-04-470x470.jpg\" alt=\"Lan Hạc Đỉnh Đà Lạt giá rẻ -Redep24.com\" width=\"300\" height=\"300\" /></a> Lan Hạc Đỉnh Đà Lạt giá rẻ -Redep24.com[/caption]\r\n\r\nMỗi chậu 5 cành bông đang bán tại FaceCoffee, ĐC: 31 Lê Tấn Quốc, P13 , Q Tân Bình, Tp HCM\r\n\r\nỞ Việt Nam có 4 loài Phaius được biết là Phaius tankervilliae. Phaius indigofera, Phaius mishlllensis, Phaius flavusnhưng chỉ có loài đầu mới thực sự có hoa đẹp, loài này mọc rất nhiều từ Di Linh đến Lang Hanh trong các tràng trống có đầm lầy trong rừng, chúng thường mọc xen với các loài cỏ dại và các loài lan khác tên là Ngãi bưởi (Dipodium paludosum) Vân hài (Paphiopedilum callosulll), Cau diệp ngà (Spathoglottis eburnea).\r\n\r\nHạc đỉnh thuộc nhóm đa thân với các giả hành hình tháp lá to rộng 15 x 60cm, hoa to với đường kính 12cm, gồm rất nhiều màu sắc khá đặc biệt. Hoa có mùi thơn, lưỡi hình ống như Cattleya, đài và cánh có màu sắc giống nhau, mặt sau màu trăng sữa, mặt trước tùy theo thứ loài do quá trình lai tạo tự nhiên, có nhiều màu biến đổi từ nâu đỏ, sôcôla, đến vàng xanh. Hạc đỉnh là một trong những cây lan nhiệt đới đầu tiên nở hoa Ở Châu Âu. Đây là loại lan hoàn toàn chịu ầm, điều kiện sinh thái tự nhiên là các vùng đầm lầy, vì thế khi bị úng nước ở giá thể sẽ không làm cây chết.\r\n\r\n[caption id=\"attachment_826\" align=\"aligncenter\" width=\"300\"]<a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/02/dia-lan-hac-dinh-dalat-02.jpg\"><img class=\"wp-image-826 size-medium\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/02/dia-lan-hac-dinh-dalat-02-470x470.jpg\" alt=\"Lan hạc đĩnh Đà Lạt rẻ đẹp\" width=\"300\" height=\"300\" /></a> Lan hạc đĩnh Đà Lạt rẻ đẹp[/caption]\r\n\r\n<span style=\"text-decoration: underline\"><strong>Hướng dẫn chăm sóc:</strong></span>\r\nHạc đỉnh là loài lan đất nên giá thể gồm 2 phần tro trấu, 1 phần đất mùn + 1 phần phân bò hoai  l/20 bánh dầu xay nhuyễn có thể tưới thêm phân NPK 30-10-10, tưới 2 lần/tuần trong suốt mùa tăng trưởng. Suốt năm nước được tưới 1 ngày 3 lần. Chỉ trừ 1 tháng sau khi hoa trổ, cho cây nghỉ hoàn toàn không tưới. Một giá thể khác tỏ ra hữu hiệu hơn: một phần tro trấu + 1 phần rơm mục + 1 phần phân bò hoai+ 1/20 bánh dầu xay nhuyễn. Lan Hạc đĩnh có thể nhân giống đơn giản bằng 1 giả hành như Cymbidium.\r\n\r\n&nbsp;\r\n\r\n<strong>Tuy nhiên với số lượng giả hành càng nhiều cây càng tăng trưởng mạnh, tối thiểu là 3 giả hành để đảm bảo cho cây ra hoa trong mùa tới. Ngoài ra cây Hạc đỉnh còn có thể nhân giống bằng phát hoa như một số loài thuộc giống Phalaenopsis, khả năng phát triển của cây con trên mỗi đốt của phát hoa rất mạnh.</strong>\r\n\r\n[caption id=\"attachment_827\" align=\"aligncenter\" width=\"450\"]<a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/02/dia-lan-hac-dinh-dalat-03.jpg\"><img class=\"wp-image-827 size-full\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/02/dia-lan-hac-dinh-dalat-03.jpg\" alt=\"Lan Hạc Đĩnh Đà Lạt rẻ đẹp\" width=\"450\" height=\"350\" /></a> Lan Hạc Đĩnh Đà Lạt rẻ đẹp[/caption]\r\n\r\n&nbsp;\r\n\r\nKhi Hạc đỉnh vừa tàn, ta cất phát hoa lìa khói giả hành và nhúng vào parafin đặt nằm ngang trên mặt cát hay luồn trong các đám cỏ dại hoặc bất cứ nơi nào có ẩm độ 100% với ánh sáng yếu 30%. Sau thời gian chừng 3 tháng, hầu như mỗi đốt của phát hoa đều mọc một cây con, trong khi đó trục sẽ thối dần. Lúc ấy ta đem trồng từng cây vào các chậu tương xứng với giá thể như đã nói trên và cây sẽ ra hoa sau thời gian 4 năm. Hạc đỉnh ít bị sâu bệnh, thường bị sâu ăn lá và các loại cào cào cắn phá. Đây là loài hoa rất lý tưởng để trang trí các phòng khách, phòng họp có không gian rộng.', 'Lan Hạc Đỉnh Đà Lạt -Phaius Vietnam', '', 'publish', 'open', 'open', '', 'lan-hac-dinh-da-lat-phaius-vietnam', '', '', '2015-11-21 11:21:34', '2015-11-21 04:21:34', '', 0, 'http://redep24.lavadep.com/?p=824', 0, 'post', '', 0),
(737, 4, '2015-01-22 13:41:55', '2015-01-22 06:41:55', '[caption id=\"attachment_740\" align=\"aligncenter\" width=\"300\"]<a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/01/qua-tet-doanh-nghiep-re-dep-04.png\"><img class=\"wp-image-740 size-medium\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/01/qua-tet-doanh-nghiep-re-dep-04-470x470.png\" alt=\"Giỏ quà Tết doanh nghiệp rẻ đẹp, ý nghĩa\" width=\"300\" height=\"300\" /></a> Giỏ quà Tết doanh nghiệp rẻ đẹp, ý nghĩa[/caption]\r\n\r\nCông ty Á Châu chuyên cung cấp các giỏ quà tết cho doanh nghiệp dành biếu cho khách hàng trong dịp tết hàng năm,  cam kết mang đến những giỏ quà tết:\r\n<ul>\r\n	<li>Giỏ quà tết đa dạng, với nhiều mức giá khác nhau.</li>\r\n	<li>Cam kết không sử dụng hàng cũ, hết date (có thể đổi trả hàng nếu không hài lòng)</li>\r\n	<li>Có dịch vụ giao hàng tận nơi.</li>\r\n	<li>Xuất hóa đơn VAT (nếu doanh nghiệp yêu cầu)</li>\r\n	<li>Giao hàng đúng hẹn.</li>\r\n	<li>Nhận đơn hàng với số lượng lớn</li>\r\n	<li>Các loại<i> giỏ quà tết tặng khách hàng trong dịp tết 2015</i> (phân loại theo giá) cụ thể như bên dưới:</li>\r\n</ul>\r\n<b>Giỏ quà tết tặng khách hàng, nhân viên 1:</b>\r\nthành phần gồm:\r\n1. Rượu vang\r\n2.Trà\r\n3. Bánh\r\n4. Mức\r\n5. Kẹo\r\n6. Cafe\r\n<div class=\"separator\"> <a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/01/qua-tet-doanh-nghiep-re-dep-01.jpg\"><img class=\"aligncenter wp-image-738 size-medium\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/01/qua-tet-doanh-nghiep-re-dep-01-470x470.jpg\" alt=\"Giỏ quà Tết  doanh nghiệp rẻ đẹp, ý nghĩa\" width=\"300\" height=\"300\" /></a></div>\r\n<div class=\"separator\"></div>\r\n&nbsp;\r\n<div class=\"separator\"></div>\r\n<strong>Giỏ quà tết tặng khách hàng, nhân viên  2:</strong>\r\nthành phần gồm:\r\n1. Rượu vang\r\n2.Trà\r\n3. Bánh\r\n4. Mức\r\n5. Kẹo\r\n6. Cafe\r\n<div class=\"separator\"></div>\r\n<div class=\"separator\"> <a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/01/qua-tet-tang-khach-hang-2.png\"><img class=\"aligncenter wp-image-741 size-medium\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/01/qua-tet-tang-khach-hang-2-470x470.png\" alt=\"Giỏ quà Tết  doanh nghiệp rẻ đẹp, ý nghĩa\" width=\"300\" height=\"300\" /></a></div>\r\n<div></div>\r\nGiỏ quà tết tặng khách hàng 3:\r\nthành phần gồm:\r\n1. Rượu vang\r\n2.Trà\r\n3. Bánh\r\n4. Mức\r\n5. Kẹo\r\n6. Cafe\r\n<div class=\"separator\"></div>\r\n<div><strong><i>giỏ quà Tết tặng nhân viên, khách hàng 3</i></strong></div>\r\n<div><a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/01/qua-tet-doanh-nghiep-re-dep-03.jpg\"><img class=\"alignnone wp-image-739 size-full\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/01/qua-tet-doanh-nghiep-re-dep-03.jpg\" alt=\"Giỏ quà Tết  doanh nghiệp rẻ đẹp, ý nghĩa\" width=\"348\" height=\"400\" /></a></div>\r\n<b>Giỏ quà tết tặng khách hàng</b> theo yêu cầu: ngoài việc cung cấp các gói quà tết có sẳn, công ty Á Châu còn cung cấp dịch vụ gói quà tết theo yêu cầu của khách hàng, chi tiết vui lòng liên hệ số điện thoại hotline để có được thông tin mới nhất và chính xác nhất.', 'Giỏ quà Tết  doanh nghiệp 2015', '', 'publish', 'open', 'open', '', 'gio-qua-tet-doanh-nghiep-2015', '', '', '2015-11-10 09:36:08', '2015-11-10 02:36:08', '', 0, 'http://redep24.lavadep.com/?p=737', 0, 'post', '', 1),
