(1081, 21, '2016-01-23 20:39:33', '2016-01-23 13:39:33', 'Đệm massage toàn thân New Magic XD- 803 tại <a title=\"Website bán đồ rẻ &amp; đẹp ở VN\" href=\"http://redep24.lavadep.com\" target=\"_blank\">Redep24.com</a> là giải pháp hữu hiệu chấm dứt các tình trạng đau lưng, đau vai gáy, nhức mỏi cơ thể.<strong> </strong>Bên cạnh đó, bạn còn có thể được massage lưng, cổ, đầu, mông chuyên sâu.\r\n\r\n<img class=\"alignnone  wp-image-1076\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2016/01/dem-massage-toan-than-xd-803-redep24.png\" alt=\"dem-massage-toan-than-xd-803-redep24\" width=\"601\" height=\"601\" />\r\n<h2>Tính năng:</h2>\r\n<ul>\r\n	<li>Đệm có <strong>4 chức năng</strong>: massage, ray, rung, đấm, nhiệt -  <strong>3 chế độ ray</strong>: cao, thấp, tất cả phần lưng và <strong>2 chế độ bóp</strong>: ray bóp, bóp phần vai, cổ. Tất cả các thao tác cơ bản có trong một đệm massage toàn thân, nhờ đó toàn bộ cơ thể được phục hồi và một số bệnh như đau đầu, đau lưng, đau thần kinh tọa, đau bụng kinh nguyệt, đường ruột hoặc những vấn đề về hệ tuần hoàn, hô hấp và cả dị ứng đều giảm hoặc khỏi hẳn.</li>\r\n	<li>Các con lăn di chuyển linh hoạt xoa bóp hiệu quả các vùng mệt mỏi từ vai xuống kèm theo chế độ mát xa đáp ứng từng vùng riêng biệt và mát xa kết hợp. Bộ nắn dòng 220V giúp bạn được mát xa khi ở nhà, ở văn phòng. Vừa là ghế mát xa, vừa là ghế ngủ trưa, xem phim cho cả gia đình.</li>\r\n</ul>\r\n<img class=\"alignnone  wp-image-1073\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2016/01/dem_massage_xd803_redep24.png\" alt=\"dem_massage_xd803_redep24\" width=\"636\" height=\"530\" />\r\n\r\n- Phương pháp trị liệu ở phần lưng, áp khí trên vai và lưng, xoa bóp trên cổ, rung ở phần hông và tính năng làm ấm ở phần lưng.\r\n\r\n- Có ba quá trình trị liệu ở phần lưng, đầy đủ, ở phía trên và phía dưới. Bạn có thể kiểm soát không khí nén ở phía lưng và vai.\r\n\r\n- Bạn có thể điều khiển riêng tính năng làm ấm (Sẽ kích hoạt khi hoạt động).\r\n\r\n- Bạn có thể điều chỉnh vị trí mát xa của vai (khi tắt chức năng mát xa khí).\r\n\r\n- Tự động cài đặt thời gian trong khoảng 15 phút.\r\n\r\n- Điều khiển riêng phần rung hông.\r\n\r\n<strong>Đệm massage toàn thân</strong><span class=\"Apple-converted-space\"> </span>tác động từ bên ngoài và sâu bên trong cơ thể như tới cơ, gân, khớp, các mô liên kết, các dây thần kinh, hệ tiêu hóa và hệ hô hấp, kết quả là giải thoát các ách tắc của các luồng chân khí trong khi di chuyển trong cơ thể, kích thích các luồng chân khí di chuyển tuần hoàn và giải phóng năng lượng thông qua các huyệt đạo.\r\n\r\n<img class=\"alignnone size-full wp-image-1075\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2016/01/dem-massage-toan-than-xd-803-re-dep.png\" alt=\"dem-massage-toan-than-xd-803-re-dep\" width=\"700\" height=\"700\" />\r\n\r\n<strong>Hướng dẫn sử dụng đệm <a href=\"http://redep24.lavadep.com/dem-massage-toan-than-magic-xd-803/\">Massage toàn thân XD-803</a>:</strong>\r\n<ul>\r\n	<li>Sử dụng đơn giản, bạn có thể sử dụng để vừa nằm xem tài liệu, đọc báo, xem tivi trên máy massage lưng XD-803… vừa thư giãn đầu óc lại giúp cơ thể giảm được sự mệt mỏi.</li>\r\n	<li>Đặt<span class=\"Apple-converted-space\"> </span><strong>máy massage</strong> trên chiếc ghế sofa hoặc ghế bình thường. Buộc chặt dây đai để cố định. Cắm điện, nếu bộ phận mát xa vai không ở phía trên cùng của ghế, bộ phần này sẽ quay trở về vị trí trên cùng một cách tự động. Cùng lúc đó, nếu bộ phận mát xa lưng không ở phía dưới cùng, bộ phận này sẽ quay trở lại phía dưới cùng một cách tự động. Sau đó, nút On/Off nhấp nháy, đèn xanh mát xa phía sau sẽ sáng.</li>\r\n	<li>Sau khi khôi phục, tất cả các nút đều không hoạt động. Đèn On/Off tắt, đèn mát xa phía sau tắt.</li>\r\n</ul>\r\n<img class=\"alignnone size-full wp-image-1074\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2016/01/dem_massage_xd803-gia-re.png\" alt=\"dem_massage_xd803-gia-re\" width=\"650\" height=\"650\" />\r\n<h2>Thông số kỹ thuật của Đệm massage Magic XD - 803</h2>\r\n<div>-<strong><span class=\"Apple-converted-space\"> </span>T</strong><strong>ên sản phẩm: </strong>Đệm massage Magic XD - 803\r\n<strong>- Model: </strong>XD-803\r\n<strong>- Điện áp:</strong><span class=\"Apple-converted-space\"> </span>220V - 50Hz\r\n<strong>- Công suất:</strong><span class=\"Apple-converted-space\"> </span>48W\r\n<strong>- Trọng lượng:</strong><span class=\"Apple-converted-space\"> </span>6,7 kg\r\n<strong>- Chất liệu:</strong><span class=\"Apple-converted-space\"> </span>Vỏ da, Nhựa PP\r\n<strong>- Xuất xứ:</strong><span class=\"Apple-converted-space\"> </span>Made In Korea\r\n<strong>- Công dụng:</strong><span class=\"Apple-converted-space\"> </span>Massage lưng, cổ, mông, đa năng...\r\n<strong>- Bảo hành:<span class=\"Apple-converted-space\"> </span></strong>12 tháng</div>\r\n&nbsp;', 'ĐỆM MASSAGE TOÀN THÂN MAGIC XD-803', '', 'inherit', 'open', 'closed', '', '1072-revision-v1', '', '', '2016-01-23 20:39:33', '2016-01-23 13:39:33', '', 1072, 'http://redep24.lavadep.com/1072-revision-v1/', 0, 'revision', '', 0),
(1082, 21, '2016-01-27 07:51:32', '2016-01-27 00:51:32', '<p>Mua ngay<strong><span class=\"Apple-converted-space\"> </span>máy tập cơ bụng Six Pack Care</strong><span class=\"Apple-converted-space\"> tại<strong> <a title=\"Website bán đồ rẻ mà đẹp ở VN\" href=\"http://redep24.lavadep.com\" target=\"_blank\">redep24.com</a></strong></span> nhận ngay quà tặng ý nghĩa, nâng cao sức khỏe cho cả nhà.</p><p><a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2016/01/sixpackedit1251.png\"><img class=\"alignnone size-full wp-image-1068\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2016/01/sixpackedit1251.png\" alt=\"sixpackedit125\" width=\"800\" height=\"450\" /></a></p><p>&nbsp;</p><p><span id=\"MainContent_ucNewsInfo1_lblname\">Máy tập cơ bụng New Six Pack Care 2018</span><span class=\"Apple-converted-space\"> </span>- Sản phẩm nhiều cải tiến so với máy tập thông thường.<span class=\"Apple-converted-space\"><br /> </span></p><p><img class=\"alignnone  wp-image-1055\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2016/01/new-six-pack-care-2016-1_1382091138-470x470.png\" alt=\"new-six-pack-care-2016-1_1382091138\" width=\"509\" height=\"509\" /></p><p><em><strong>Thông tin sản phẩm:</strong></em></p><p>- Tên sản phẩm :<span class=\"Apple-converted-space\"> </span><strong><span id=\"ContentPlaceHolder1_ctl00_lbname\"><a title=\"Máy tập cơ bụng 6 múi\" href=\"http://redep24.lavadep.com/may-tap-co-bung-new-six-pack-care/\">MÁY TẬP BỤNG TỔNG HỢP SIX PACK CARE</a> 2016</span></strong><br /> - Thương hiệu: Six Pack Care<br /> - Model           : 2016 - CNT-8627<span class=\"Apple-converted-space\"> </span><br /> - Kích thước   : 98 x 125 x 35cm<br /> - Trọng lượng : 12 Kg ( bao gồm cả vỏ hộp )<br /> - Trọng tải       : 150 kg<br /> - Màu khung   : Màu xám.<br /> - Khung thép  : Dày và to<br /> - Lò xo            : 6 lò xo to<br /> - Các con lăn : Chắc và mịn<br /> - Công nghệ  : Sơn tĩnh điện (rất mịn)<br /> - Ghế ngồi     : Dày và rất chắc chắn<br /> - Thương hiệu Hàn Quốc - gia công lắp ráp tại Đài Loan.<br /> - Bảo hành: 24 tháng</p><p><img class=\"alignnone  wp-image-1052\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2016/01/Máy-tập-cơ-bụng-Six-Park-Care-4-470x470.png\" alt=\"Máy-tập-cơ-bụng-Six-Park-Care-4\" width=\"518\" height=\"518\" /></p><p><strong>Đặc điểm nổi bật:</strong></p><p><strong><span id=\"MainContent_ucNewsInfo1_lblname\">MÁY TẬP BỤNG TỔNG HỢP SIX PACK CARE</span></strong><span class=\"Apple-converted-space\"> </span>có thể thay thế được rất nhiều các loại máy khác giúp bạn tập chân thoải mái. Tuy nhiều chức năng nhưng nếu không sử dụng, bạn có thể gấp gọn máy lại để giảm diện tích phòng.</p><p>Việc tập luyện với máy sẽ giúp đánh tan lượng mỡ dư thừa ở các vị trí như bụng, hông, mông, đùi, bắp tay, giúp bạn nhanh chóng có ngay vòng eo thon gọn. Ngoài ra, khi tập luyện sẽ tiêu hao lượng calo nhiều hơn, tăng cường khả năng tiêu hao mỡ thừa, điều hòa các cơ quan nội tạng trong cơ thể.</p><p><img class=\"aligncenter wp-image-1054\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2016/01/may-tap-six-pack-care-470x470.png\" alt=\"may-tap-six-pack-care\" width=\"622\" height=\"622\" /></p><p><span id=\"ctl10_lb_gioithieu\">Với<span class=\"Apple-converted-space\"> </span><strong>7 động tác trên 6 khu vực cụ thể toàn thân (vùng bụng, cơ bụng trên, bụng giữa, bụng dưới và cơ chéo 2 bên hông),</strong><span class=\"Apple-converted-space\"> </span>toàn bộ vùng bụng được co bóp một cách tối đa, vùng mông và vùng eo cũng được vận động đều. Áp dụng các động tác đều đặn mỗi ngày là một trong những cách tốt nhất để kéo chậm hoặc ngừa suy giảm cơ, xương và khớp, săn chắc nhóm cơ, cải thiện hệ thống tim mạch và sức khỏe.</span></p><p><img class=\"alignnone size-full wp-image-1057\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2016/01/may_tap_co_bung_six_pack_care-2016-450x305.png\" alt=\"may_tap_co_bung_six_pack_care-2016-450x305\" width=\"450\" height=\"305\" /><img class=\"alignnone size-medium wp-image-1053\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2016/01/may-tap-da-nang-six-pack-care-4-470x470.png\" alt=\"may-tap-da-nang-six-pack-care-4\" width=\"300\" height=\"300\" /></p><p>7 bài tập trên máy là các động tác sử dụng nhiều sức lực và có tác động rất lớn tới cơ bụng. Bạn chỉ cần tập tất cả bài tập hai lần trong thời gian 10 phút, lặp lại từ 4 tới 5 ngày trong một tuần chắc chắn sẽ giúp bạn “tống khứ” mỡ thừa ở eo và tăng độ dẻo dai cho các vùng khác trên cơ thể.</p><p><img class=\"aligncenter wp-image-1058\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2016/01/new-six-pack-care-2016-2_1382091328-470x470.png\" alt=\"new-six-pack-care-2016-2_1382091328\" width=\"527\" height=\"527\" /></p><p>Lợi ích từ<span class=\"Apple-converted-space\"> </span><strong><span id=\"MainContent_ucNewsInfo1_lblname\">MÁY TẬP BỤNG TỔNG HỢP SIX PACK CARE</span></strong></p><p>-<span class=\"Apple-converted-space\"> </span>Máy sẽ giúp bạn giảm cân, giảm số đo, làm săn chắc cơ thể đồng thời làm mịn da và biến mất cellulite mang lại cho bạn nam thân hình săn chắc, ban nữ thì quyến rũ hấp dẫn. <span class=\"Apple-converted-space\"> </span></p><p>- Làm cơ lưng mạnh bởi các động tác kéo căng cơ, ngăn ngừa đau lưng và chân nên giữ tư thế lưng thật tốt khi làm việc cũng như ở nhà.</p><p>- Tăng cường hệ tim mạch, góp phần chống lại chứng bất lực, điều hòa năng lượng cơ thể và về lâu dài có thể làm chậm tiến trình lão hóa, kéo dài tuổi thọ của con người.</p><p>- Làm máu lưu thông dễ dàng đến mọi chỗ trong cơ thể, chuyển vận oxy và các chất dưỡng sinh khác nuôi dưỡng các tế bào, tạo năng lượng hoạt động cho con người.</p><p>- Đánh tan lượng mỡ dư thừa ở các vị trí như bụng, hông, mông, đùi, bắp tay, giúp bạn nhanh chóng có được vòng eo thon gọn và điều hòa các cơ quan nội tạng trong cơ thể, nhất là đối với người béo.</p><p>- Giúp chuyển hóa<span class=\"Apple-converted-space\"> </span>mỡ thừa<span class=\"Apple-converted-space\"> </span>thành dạng lỏng và đào thải ra ngoài một cách tự nhiên theo nước tiểu và  tuyến mồ hôi. Lợi ích cuối cùng là tăng cường khả năng chịu đựng stress, giúp cơ thể tránh sự mỏi mệt và suy sụp tinh thần, giảm nguy cơ ung thư (tuyến tiền liệt, kết tràng).</p><p><strong>Máy tập bụng SIX PACK CARE</strong><span class=\"Apple-converted-space\"> </span>giúp bạn nhanh chóng sở hữu body chuẩn, giúp bạn tự tin với thân hình cân đối quyến rũ, không thể thiếu trong không gian nhà bạn, tiết kiệm thời gian và công sức đến các phòng tập ....</p><p><strong>Chỉ với 10-30 phút mỗi ngày với sản phẩm <span id=\"MainContent_ucNewsInfo1_lblname\">MÁY TẬP BỤNG TỔNG HỢP SIX PACK CARE</span><span class=\"Apple-converted-space\"> </span>cùng với sự cố gắng, nỗ lực và tập trung cao độ, bạn sẽ cải thiện được vòng eo của mình một cách hiệu quả và nhanh chóng nhất.<br /> </strong></p><p>HƯỚNG DẪN CÁC TƯ THẾ TẬP VỚI MÁY</p><p><a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2016/01/may-tap-co-bung-new-six-pack-care-2017-1418789060.png\"><img class=\"alignnone wp-image-1059 size-full\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2016/01/may-tap-co-bung-new-six-pack-care-2017-1418789060.png\" alt=\"may-tap-co-bung-new-six-pack-care-2017-1418789060\" width=\"656\" height=\"478\" /></a></p><p><a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2016/01/may-tap-co-bung-new-six-pack-care-2017-1418789080.jpg\"><img class=\"alignnone wp-image-1060 size-full\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2016/01/may-tap-co-bung-new-six-pack-care-2017-1418789080.jpg\" alt=\"may-tap-co-bung-new-six-pack-care-2017-1418789080\" width=\"656\" height=\"706\" /></a></p><p><a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2016/01/may-tap-co-bung-new-six-pack-care-2017-1418789095.png\"><img class=\"alignnone wp-image-1061 size-full\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2016/01/may-tap-co-bung-new-six-pack-care-2017-1418789095.png\" alt=\"may-tap-co-bung-new-six-pack-care-2017-1418789095\" width=\"656\" height=\"802\" /></a></p><p><a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2016/01/may-tap-co-bung-new-six-pack-care-2017-1418789109.png\"><img class=\"alignnone wp-image-1062 size-full\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2016/01/may-tap-co-bung-new-six-pack-care-2017-1418789109.png\" alt=\"may-tap-co-bung-new-six-pack-care-2017-1418789109\" width=\"656\" height=\"776\" /></a></p><p><a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2016/01/may-tap-co-bung-new-six-pack-care-2017-1418789125.png\"><img class=\"alignnone wp-image-1063 size-full\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2016/01/may-tap-co-bung-new-six-pack-care-2017-1418789125.png\" alt=\"may-tap-co-bung-new-six-pack-care-2017-1418789125\" width=\"656\" height=\"406\" /></a></p>', 'Máy tập cơ bụng Six Pack Care', '', 'inherit', 'open', 'closed', '', '1051-revision-v1', '', '', '2016-01-27 07:51:32', '2016-01-27 00:51:32', '', 1051, 'http://redep24.lavadep.com/1051-revision-v1/', 0, 'revision', '', 0),
(1079, 21, '2016-01-23 20:36:42', '2016-01-23 13:36:42', 'Đệm massage toàn thân New Magic XD- 803 tại <a title=\"Website bán đồ rẻ &amp; đẹp ở VN\" href=\"http://redep24.lavadep.com\" target=\"_blank\">Redep24.com</a> là giải pháp hữu hiệu chấm dứt các tình trạng đau lưng, đau vai gáy, nhức mỏi cơ thể.<strong> </strong>Bên cạnh đó, bạn còn có thể được massage lưng, cổ, đầu, mông chuyên sâu.\r\n\r\n<img class=\"alignnone  wp-image-1076\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2016/01/dem-massage-toan-than-xd-803-redep24.png\" alt=\"dem-massage-toan-than-xd-803-redep24\" width=\"601\" height=\"601\" />\r\n<h2>Tính năng:</h2>\r\n<ul>\r\n	<li>Đệm có <strong>4 chức năng</strong>: massage, ray, rung, đấm, nhiệt -  <strong>3 chế độ ray</strong>: cao, thấp, tất cả phần lưng và <strong>2 chế độ bóp</strong>: ray bóp, bóp phần vai, cổ. Tất cả các thao tác cơ bản có trong một đệm massage toàn thân, nhờ đó toàn bộ cơ thể được phục hồi và một số bệnh như đau đầu, đau lưng, đau thần kinh tọa, đau bụng kinh nguyệt, đường ruột hoặc những vấn đề về hệ tuần hoàn, hô hấp và cả dị ứng đều giảm hoặc khỏi hẳn.</li>\r\n	<li>Các con lăn di chuyển linh hoạt xoa bóp hiệu quả các vùng mệt mỏi từ vai xuống kèm theo chế độ mát xa đáp ứng từng vùng riêng biệt và mát xa kết hợp. Bộ nắn dòng 220V giúp bạn được mát xa khi ở nhà, ở văn phòng. Vừa là ghế mát xa, vừa là ghế ngủ trưa, xem phim cho cả gia đình.</li>\r\n</ul>\r\n<img class=\"alignnone  wp-image-1073\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2016/01/dem_massage_xd803_redep24.png\" alt=\"dem_massage_xd803_redep24\" width=\"636\" height=\"530\" />\r\n\r\n- Phương pháp trị liệu ở phần lưng, áp khí trên vai và lưng, xoa bóp trên cổ, rung ở phần hông và tính năng làm ấm ở phần lưng.\r\n\r\n- Có ba quá trình trị liệu ở phần lưng, đầy đủ, ở phía trên và phía dưới. Bạn có thể kiểm soát không khí nén ở phía lưng và vai.\r\n\r\n- Bạn có thể điều khiển riêng tính năng làm ấm (Sẽ kích hoạt khi hoạt động).\r\n\r\n- Bạn có thể điều chỉnh vị trí mát xa của vai (khi tắt chức năng mát xa khí).\r\n\r\n- Tự động cài đặt thời gian trong khoảng 15 phút.\r\n\r\n- Điều khiển riêng phần rung hông.\r\n\r\n<strong>Đệm massage toàn thân</strong><span class=\"Apple-converted-space\"> </span>tác động từ bên ngoài và sâu bên trong cơ thể như tới cơ, gân, khớp, các mô liên kết, các dây thần kinh, hệ tiêu hóa và hệ hô hấp, kết quả là giải thoát các ách tắc của các luồng chân khí trong khi di chuyển trong cơ thể, kích thích các luồng chân khí di chuyển tuần hoàn và giải phóng năng lượng thông qua các huyệt đạo.\r\n\r\n<img class=\"alignnone size-full wp-image-1075\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2016/01/dem-massage-toan-than-xd-803-re-dep.png\" alt=\"dem-massage-toan-than-xd-803-re-dep\" width=\"700\" height=\"700\" />\r\n\r\n<strong>Hướng dẫn sử dụng đệm Massage toàn thân XD-803:</strong>\r\n<ul>\r\n	<li>Sử dụng đơn giản, bạn có thể sử dụng để vừa nằm xem tài liệu, đọc báo, xem tivi trên máy massage lưng XD-803… vừa thư giãn đầu óc lại giúp cơ thể giảm được sự mệt mỏi.</li>\r\n	<li>Đặt<span class=\"Apple-converted-space\"> </span><strong>máy massage</strong> trên chiếc ghế sofa hoặc ghế bình thường. Buộc chặt dây đai để cố định. Cắm điện, nếu bộ phận mát xa vai không ở phía trên cùng của ghế, bộ phần này sẽ quay trở về vị trí trên cùng một cách tự động. Cùng lúc đó, nếu bộ phận mát xa lưng không ở phía dưới cùng, bộ phận này sẽ quay trở lại phía dưới cùng một cách tự động. Sau đó, nút On/Off nhấp nháy, đèn xanh mát xa phía sau sẽ sáng.</li>\r\n	<li>Sau khi khôi phục, tất cả các nút đều không hoạt động. Đèn On/Off tắt, đèn mát xa phía sau tắt.</li>\r\n</ul>\r\n<img class=\"alignnone size-full wp-image-1074\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2016/01/dem_massage_xd803-gia-re.png\" alt=\"dem_massage_xd803-gia-re\" width=\"650\" height=\"650\" />\r\n\r\n&nbsp;', 'ĐỆM MASSAGE TOÀN THÂN MAGIC XD-803', '', 'inherit', 'open', 'closed', '', '1072-revision-v1', '', '', '2016-01-23 20:36:42', '2016-01-23 13:36:42', '', 1072, 'http://redep24.lavadep.com/1072-revision-v1/', 0, 'revision', '', 0),
