ng.</li>\r\n	<li>Sau khi khôi phục, tất cả các nút đều không hoạt động. Đèn On/Off tắt, đèn mát xa phía sau tắt.</li>\r\n</ul>\r\n<a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2016/01/dem_massage_xd803-gia-re.png\"><img class=\"alignnone size-full wp-image-1074\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2016/01/dem_massage_xd803-gia-re.png\" alt=\"dem_massage_xd803-gia-re\" width=\"650\" height=\"650\" /></a>\r\n\r\n&nbsp;', 'ĐỆM MASSAGE TOÀN THÂN MAGIC XD-803', '', 'inherit', 'open', 'closed', '', '1072-revision-v1', '', '', '2016-01-23 20:34:23', '2016-01-23 13:34:23', '', 1072, 'http://redep24.lavadep.com/1072-revision-v1/', 0, 'revision', '', 0),
