(894, 1, '2015-11-21 11:28:11', '2015-11-21 04:28:11', '[caption id=\"attachment_799\" align=\"aligncenter\" width=\"300\"]<a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/02/rau-cu-qua-say-kho-dalat-05.jpg\"><img class=\"wp-image-799 size-medium\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/02/rau-cu-qua-say-kho-dalat-05-470x470.jpg\" alt=\"Rau củ quả sấy Đà Lạt, miếng chất lượng\" width=\"300\" height=\"300\" /></a> Rau củ quả sấy Đà Lạt, miếng chất lượng[/caption]\r\n\r\nĐược chế biến từ các loại Rau, Củ, Quả xanh ngon của Đà Lạt như: chuối, khoai lang, đậu cove, đậu đũa, thơm, mít, cà rốt, củ dền, cà tím, đậu bắp, … Đặc biệt là không bị nát và đóng đường phía trên. Miếng sấy được giữ hầu như nguyên vẹn.\r\n\r\nTHẬP CẨM SẤY là món rau củ thập cẩm sấy giòn mà du khách Đà Lạt nào cũng yêu thích. Rau củ được sấy giòn tan nhưng vẫn giữ được hương vị của từng loại riêng biệt.\r\n\r\n- Mít sấy khô\r\n\r\n- Khoai lang tím sấy khô\r\n\r\n- Khoai lang sấy\r\n\r\n- Khoai môn sấy\r\n\r\n- Khoai lang gừng\r\n\r\n- Khoai lang dẻo\r\n\r\n[caption id=\"attachment_798\" align=\"aligncenter\" width=\"300\"]<a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/02/rau-cu-qua-say-kho-dalat-04.jpg\"><img class=\"wp-image-798 size-medium\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/02/rau-cu-qua-say-kho-dalat-04-470x462.jpg\" alt=\"rau-cu-qua-say-kho-dalat-04\" width=\"300\" height=\"294\" /></a> Rau củ quả sấy Đà Lạt, miếng to chất lượng[/caption]', 'Rau củ quả sấy Dalat', '', 'inherit', 'open', 'closed', '', '794-revision-v1', '', '', '2015-11-21 11:28:11', '2015-11-21 04:28:11', '', 794, 'http://redep24.lavadep.com/794-revision-v1/', 0, 'revision', '', 0),
