(917, 9, '2015-12-09 09:56:22', '2015-12-09 02:56:22', 'Mọi loại nước hoa của Lancôme đều có vẻ lãng mạn của riêng nó. Tresor Midnight Rose còn tạo cho người dùng cảm giác lạc quan, vui vẻ, tràn đầy nặng lượng. Hương thơm của Tresor Midnight Rose là sự ấm áp, ngọt ngào nhưng huyền diệu với ý tưởng một bôn<span class=\"text_exposed_show\">g hoa chỉ nở vào lúc nửa đêm.</span>\r\n\r\nMùi hương đặc trưng:\r\nHương đầu : tuyết tùng, vanilla\r\nHương giữa : hoa nhài, hoa mẫu đơn, hạt tiêu hồng\r\nHương cuối : mâm xôi, hoa hồng...\r\n\r\nPhong cách:\r\n\r\nNhẹ nhàng, tinh tế, quyến rũ\r\n\r\n[caption id=\"attachment_626\" align=\"alignnone\" width=\"300\"]<a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/01/nuoc-hoa-lady-tresor-midnight-rose-7m.jpg\"><img class=\"wp-image-626 size-medium\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/01/nuoc-hoa-lady-tresor-midnight-rose-7m-470x470.jpg\" alt=\"nuoc-hoa-lady-tresor-midnight-rose-lancome\" width=\"300\" height=\"300\" /></a> Tresor Midnight Rose - Lancôme - Nhẹ nhàng, tinh tế, quyến rũ[/caption]\r\n\r\n<strong>Hàng authentic 75ml 1830k.</strong>\r\n\r\n<strong>Lọ chiết 7ml  240k</strong>', 'Nước hoa Tresor Midnight Rose - Lancôme', '', 'inherit', 'open', 'closed', '', '622-revision-v1', '', '', '2015-12-09 09:56:22', '2015-12-09 02:56:22', '', 622, 'http://redep24.lavadep.com/622-revision-v1/', 0, 'revision', '', 0);
