(922, 9, '2015-12-09 10:00:21', '2015-12-09 03:00:21', 'Rực rỡ, gợi cảm, tinh tế, J\'Adore là loại nước hoa tôn vinh sự trở lại của vẻ đẹp nữ tính và sức mạnh của những xúc cảm bột phát. Nó mang mùi hương của một bó hoa lan thơm ngát, cảm giác êm ái như nhung của mận xứ Đamas và vị ngọt đậm của gỗ Amarante.\r\n\r\nMùi hương đặ<span class=\"text_exposed_show\">c trưng:</span>\r\n\r\nQuýt, Hoa lan tây, Dây thường xuân, Lan Nam Phi, Hoa hồng, Hoa Violet, Mận Đamas, Gỗ Amarante, Xạ hương, Mâm xôi.\r\n\r\nPhong cách:\r\n\r\nTự tin, gợi cảm, nữ tính.\r\n\r\n[caption id=\"attachment_617\" align=\"alignnone\" width=\"300\"]<a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/01/nuoc-hoa-Jadore-dior-7m1.jpg\"><img class=\"wp-image-617 size-medium\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/01/nuoc-hoa-Jadore-dior-7m1-470x470.jpg\" alt=\"nuoc-hoa-Jadore-dior-goi-cam-nu-tinh\" width=\"300\" height=\"300\" /></a> Nước hoa J\'adore - Dior Gợi cảm, nữ tính[/caption]\r\n\r\n<strong>Hàng authentic chai 100ml 2550 k</strong>\r\n\r\n<strong>Lọ chiết 7ml   250 k</strong>', 'Nước  hoa J\'adore - Dior', '', 'inherit', 'open', 'closed', '', '612-revision-v1', '', '', '2015-12-09 10:00:21', '2015-12-09 03:00:21', '', 612, 'http://redep24.lavadep.com/612-revision-v1/', 0, 'revision', '', 0),
