(892, 3, '2015-11-21 11:21:34', '2015-11-21 04:21:34', 'Hạc Đỉnh là loài hoa rất lý tưởng để trang trí các phòng khách, phòng họp có không gian rộng.\r\n\r\n[caption id=\"attachment_828\" align=\"aligncenter\" width=\"300\"]<a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/02/dia-lan-hac-dinh-dalat-04.jpg\"><img class=\"wp-image-828 size-medium\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/02/dia-lan-hac-dinh-dalat-04-470x470.jpg\" alt=\"Lan Hạc Đỉnh Đà Lạt giá rẻ -Redep24.com\" width=\"300\" height=\"300\" /></a> Lan Hạc Đỉnh Đà Lạt giá rẻ -Redep24.com[/caption]\r\n\r\nMỗi chậu 5 cành bông đang bán tại FaceCoffee, ĐC: 31 Lê Tấn Quốc, P13 , Q Tân Bình, Tp HCM\r\n\r\nỞ Việt Nam có 4 loài Phaius được biết là Phaius tankervilliae. Phaius indigofera, Phaius mishlllensis, Phaius flavusnhưng chỉ có loài đầu mới thực sự có hoa đẹp, loài này mọc rất nhiều từ Di Linh đến Lang Hanh trong các tràng trống có đầm lầy trong rừng, chúng thường mọc xen với các loài cỏ dại và các loài lan khác tên là Ngãi bưởi (Dipodium paludosum) Vân hài (Paphiopedilum callosulll), Cau diệp ngà (Spathoglottis eburnea).\r\n\r\nHạc đỉnh thuộc nhóm đa thân với các giả hành hình tháp lá to rộng 15 x 60cm, hoa to với đường kính 12cm, gồm rất nhiều màu sắc khá đặc biệt. Hoa có mùi thơn, lưỡi hình ống như Cattleya, đài và cánh có màu sắc giống nhau, mặt sau màu trăng sữa, mặt trước tùy theo thứ loài do quá trình lai tạo tự nhiên, có nhiều màu biến đổi từ nâu đỏ, sôcôla, đến vàng xanh. Hạc đỉnh là một trong những cây lan nhiệt đới đầu tiên nở hoa Ở Châu Âu. Đây là loại lan hoàn toàn chịu ầm, điều kiện sinh thái tự nhiên là các vùng đầm lầy, vì thế khi bị úng nước ở giá thể sẽ không làm cây chết.\r\n\r\n[caption id=\"attachment_826\" align=\"aligncenter\" width=\"300\"]<a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/02/dia-lan-hac-dinh-dalat-02.jpg\"><img class=\"wp-image-826 size-medium\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/02/dia-lan-hac-dinh-dalat-02-470x470.jpg\" alt=\"Lan hạc đĩnh Đà Lạt rẻ đẹp\" width=\"300\" height=\"300\" /></a> Lan hạc đĩnh Đà Lạt rẻ đẹp[/caption]\r\n\r\n<span style=\"text-decoration: underline\"><strong>Hướng dẫn chăm sóc:</strong></span>\r\nHạc đỉnh là loài lan đất nên giá thể gồm 2 phần tro trấu, 1 phần đất mùn + 1 phần phân bò hoai  l/20 bánh dầu xay nhuyễn có thể tưới thêm phân NPK 30-10-10, tưới 2 lần/tuần trong suốt mùa tăng trưởng. Suốt năm nước được tưới 1 ngày 3 lần. Chỉ trừ 1 tháng sau khi hoa trổ, cho cây nghỉ hoàn toàn không tưới. Một giá thể khác tỏ ra hữu hiệu hơn: một phần tro trấu + 1 phần rơm mục + 1 phần phân bò hoai+ 1/20 bánh dầu xay nhuyễn. Lan Hạc đĩnh có thể nhân giống đơn giản bằng 1 giả hành như Cymbidium.\r\n\r\n&nbsp;\r\n\r\n<strong>Tuy nhiên với số lượng giả hành càng nhiều cây càng tăng trưởng mạnh, tối thiểu là 3 giả hành để đảm bảo cho cây ra hoa trong mùa tới. Ngoài ra cây Hạc đỉnh còn có thể nhân giống bằng phát hoa như một số loài thuộc giống Phalaenopsis, khả năng phát triển của cây con trên mỗi đốt của phát hoa rất mạnh.</strong>\r\n\r\n[caption id=\"attachment_827\" align=\"aligncenter\" width=\"450\"]<a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/02/dia-lan-hac-dinh-dalat-03.jpg\"><img class=\"wp-image-827 size-full\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/02/dia-lan-hac-dinh-dalat-03.jpg\" alt=\"Lan Hạc Đĩnh Đà Lạt rẻ đẹp\" width=\"450\" height=\"350\" /></a> Lan Hạc Đĩnh Đà Lạt rẻ đẹp[/caption]\r\n\r\n&nbsp;\r\n\r\nKhi Hạc đỉnh vừa tàn, ta cất phát hoa lìa khói giả hành và nhúng vào parafin đặt nằm ngang trên mặt cát hay luồn trong các đám cỏ dại hoặc bất cứ nơi nào có ẩm độ 100% với ánh sáng yếu 30%. Sau thời gian chừng 3 tháng, hầu như mỗi đốt của phát hoa đều mọc một cây con, trong khi đó trục sẽ thối dần. Lúc ấy ta đem trồng từng cây vào các chậu tương xứng với giá thể như đã nói trên và cây sẽ ra hoa sau thời gian 4 năm. Hạc đỉnh ít bị sâu bệnh, thường bị sâu ăn lá và các loại cào cào cắn phá. Đây là loài hoa rất lý tưởng để trang trí các phòng khách, phòng họp có không gian rộng.', 'Lan Hạc Đỉnh Đà Lạt -Phaius Vietnam', '', 'inherit', 'open', 'closed', '', '824-revision-v1', '', '', '2015-11-21 11:21:34', '2015-11-21 04:21:34', '', 824, 'http://redep24.lavadep.com/824-revision-v1/', 0, 'revision', '', 0),
(987, 19, '2015-12-27 12:04:04', '2015-12-27 05:04:04', 'chuoisaydeo-hoaquadalat', 'chuoisaydeo-hoaquadalat', 'Chuối sấy dẻo - 160K/Kg', 'inherit', 'open', 'closed', '', 'chuoisaydeo-hoaquadalat', '', '', '2015-12-27 12:11:30', '2015-12-27 05:11:30', '', 984, 'http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/12/chuoisaydeo-hoaquadalat.jpg', 0, 'attachment', 'image/jpeg', 0),
(988, 19, '2015-12-27 12:04:05', '2015-12-27 05:04:05', 'chuoisay-hoaquadalat', 'chuoisay-hoaquadalat', 'Chuối sấy khô - 100K /Kg', 'inherit', 'open', 'closed', '', 'chuoisay-hoaquadalat', '', '', '2015-12-27 12:10:40', '2015-12-27 05:10:40', '', 984, 'http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/12/chuoisay-hoaquadalat.jpg', 0, 'attachment', 'image/jpeg', 0),
(989, 19, '2015-12-27 12:04:07', '2015-12-27 05:04:07', 'hongsay-hoaquadalat', 'hongsay-hoaquadalat', 'Hồng Sấy Khô - 180 K/Kg', 'inherit', 'open', 'closed', '', 'hongsay-hoaquadalat', '', '', '2015-12-27 12:09:40', '2015-12-27 05:09:40', '', 984, 'http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/12/hongsay-hoaquadalat.jpg', 0, 'attachment', 'image/jpeg', 0),
(990, 19, '2015-12-27 12:07:59', '2015-12-27 05:07:59', '<a href=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/12/khoaitay-hoaquadalat.png\"><img class=\"alignleft wp-image-985 size-medium\" src=\"http://redep24.lavadep.com/wp-content/uploads/sites/1/2015/12/khoaitay-hoaquadalat-470x470.png\" alt=\"khoaitay-hoaquadalat-hoa-qua-say-kho\" width=\"300\" height=\"300\" /></a>\r\n\r\nHoa Quả Đà Lạt giới thiệu các món đặc sản Đà Lạt để quí khách hàng mua về đãi khách, làm quà hoặc nhâm nhi trong mấy ngày tết khi sum họp bên gia đình và bạn bè<span class=\"text_exposed_show\">.</span>\r\n<div class=\"text_exposed_show\">\r\n\r\nTất cả những đặc sản này được Hoa Quả Đà Lạt lấy từ lò mứt của người nhà nên luôn cam kết nguyên liệu tươi 100%, không hoá chất bảo quản, không phẩm màu và an toàn cho sức khoẻ của khách hàng khi sử dụng. Sản phẩm luôn mới và ship từ Đà Lạt. Cam kết không bán sản phẩm cũ. Sản phẩm đều được đóng gói Zipper ép chân không.\r\n\r\nVới tiêu chí luôn đặt sự an toàn về vệ sinh thực phẩm và sức khoẻ của khách hàng lên hàng đầu. Hoa Quả Đà Lạt luôn bán hàng uy tín và chất lượng. Mong muốn gặp lại khách hàng cho những lần mua bán kế tiếp. Cảm ơn quí khách hàng đã ủng hộ sản phẩm của Hoa Quả Đà Lạt trong năm vừa qua.\r\n\r\nHoa Quả Đà Lạt sẽ giao hàng miễn phí các quận Tân Bình, Tân Phú, Phú Nhuận, 1, 3, 10, 12 trong bán kính 5km cho các đơn hàng từ 4kg trở lên. Xa hơn thì sẽ tính thêm tiền xăng xe. Giao hàng trong vòng 2 ngày.\r\n\r\nLiên Hệ :\r\n\r\nMr. Khánh - 0907191181 (TPHCM).\r\nMs.Triều - 0938051109 (Đà Lạt).\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n</div>', 'Hoa quả sấy khô Đà Lạt', '', 'inherit', 'open', 'closed', '', '984-revision-v1', '', '', '2015-12-27 12:07:59', '2015-12-27 05:07:59', '', 984, 'http://redep24.lavadep.com/984-revision-v1/', 0, 'revision', '', 0);
